aste','2022-03-20 23:18:49.345577','6570af5a-e811-45b8-a533-c4f06438e1ff'),('fd73be02-412a-4a4d-b594-c7b75251e902','½ teaspoon onion powder substitute chopped shallots','teaspoon',1,'onion powder substitute chopped shallots','2022-05-19 20:34:16.097464','81ecff09-f4d5-46c7-86d6-15489f1069aa'),('fd7c1ba2-208b-4b6d-a7f3-91c05afa9fe3','2 teaspoons kosher salt','teaspoons',2,'kosher salt','2022-04-06 02:15:44.933197','f3248d19-b91e-46da-b3ab-8735aac7c391'),('ff275016-7627-423b-b0b7-560dc2949c28','¼ cup unsweetened coconut flakes','cup',0,'unsweetened coconut flakes','2022-04-06 02:17:01.726365','30386c99-cc37-49c8-8110-7eabf566410c'),('ff6ab529-4685-4595-8785-a228c15a3cfb','3 Tbsp. (or more) sugar','Tbsp.',3,'(or more) sugar','2022-04-06 02:14:48.662068','15b901f9-3232-4f6e-9664-a243c932fe32'),('ffcbfef9-89a3-428b-8f23-01faa0eb886c','1/4 teaspoon pepper','teaspoon',0,'pepper','2022-05-19 20:38:38.354121','9bfae3cc-3cda-4945-b352-cfa9b2aea8a6');
