INSERT INTO `instructions` VALUES ('012cba62-bd9b-47a1-bb6e-485524727b01','Whisk flour, baking soda, cornstarch, and salt in a medium bowl.','2022-04-06 02:18:29.956244','d1466bc9-050b-425e-ad8e-af0675f32354',1),('016854b2-03ae-4b2b-995d-0bb04c00c725','Add the milk, sugar, vanilla, and salt to the pot and stir to combine. Allow the mixture to come up to a simmer over medium heat, stirring occasionally.','2022-05-16 02:44:19.898701','8c44b28b-2114-44bd-baf2-12fc7a2fe49e',3),('03cc25f9-482a-41d5-bc94-ccc603c38ba6','Place a rack in middle of oven; preheat to 375°. Using a #10 cookie scoop (about 6 Tbsp.), portion out dough onto 2 parchment-lined baking sheets, spacing 3\" apart. Top with remaining chocolate and press gently to adhere. Gently press 1 date quarter into top of each cookie. Sprinkle with sea salt.','2022-04-06 02:18:29.965560','d1466bc9-050b-425e-ad8e-af0675f32354',3),('04ce99be-2d0b-415c-9262-ff79dd7e08d6','Serve with fish and chips, crab cakes or salmon!','2022-03-06 02:44:19.132995','3cd3f061-f3bc-4042-84c6-bb5f13722996',3),('066b80fa-eade-42d7-be0e-1c8bf6408cef','Preheat grill to medium high heat. Brush with oil. Place chicken breasts on the grill and discard marinade. Close lid and grill covered 6 minutes. Rotate chicken and grill 5-7 minutes when juices run clear and internal temperature has reached 160°F using a meat thermometer.Top chicken breasts with cheese and close lid for 30 seconds or until melted. Remove from grill.','2022-05-19 20:34:16.157286','81ecff09-f4d5-46c7-86d6-15489f1069aa',2),('06a15cf9-9bbd-4a16-b493-d31f181b06f9','Season steak generously with salt. Grill over direct heat, keeping tenderloin (the smaller side) away from the most intense heat and turning steak about every minute or so to control flare-ups and ensure even browning, until deeply browned on all sides (including standing it on its side with tongs to render and brown fat around edges), 6–8 minutes.','2022-04-06 02:16:10.553803','e89aaa1b-efd1-444b-a26d-76f2c8a70e12',2),('06af9bda-0011-4f38-a445-6bfb5fdbc915','Add the salad ingredients to a bowl and toss.','2022-05-19 20:33:06.738268','939bd8bb-0de2-4eda-b060-db31bca15902',2),('06afa5e1-fd8b-417e-ba73-1be1239edd6e','Cook pasta in a large pot of boiling salted water, stirring occasionally, until very al dente. Drain, reserving 2 cups pasta cooking liquid.','2022-04-06 02:13:12.223333','4ddb632f-e9f1-4eed-a3bc-dc0984887e63',1),('06f35526-1578-4fa0-9d06-ad5b5a857b41','Cook the pancakes until bubbles form over the surface and begin to pop, the edges of the pancakes look dry, and the bottom is golden brown (about 60 seconds). Flip the pancakes and cook on the second side until golden brown (about 30 seconds).','2022-05-16 02:23:50.660603','82e3139c-d8a3-4b0b-9af6-3fde45528c2e',5),('08aca659-988a-4344-9522-915620d9ffbc','DO AHEAD: Can be made 1 day ahead.','2022-04-06 02:11:29.432340','f5762675-fe7e-4f23-83da-e8f379b8fef7',2),('0a8f4e81-c315-4a07-90c8-347c5e8c0aac','Melt 3 Tbsp. unsalted butter in a large Dutch oven or pot over medium-low heat. Add onion, garlic, and ½ tsp. red pepper flakes; season with salt and black pepper. Stir to combine, then cover pot and cook, stirring occasionally, until softened and just starting to take on color, 8–10 minutes.','2022-04-06 02:25:08.939135','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',2),('0b0a6984-abf1-457d-b1e8-58bd30708766','Add tomatoes and avocado. Allow chicken to rest 5-10 minutes to seal in the juices.','2022-05-19 20:34:16.162584','81ecff09-f4d5-46c7-86d6-15489f1069aa',3),('0b0f2d4f-6f93-4e05-b9d1-d81333169d9b','In a small baking dish, toss butter, cinnamon and sugar to coat the apples.','2022-05-19 20:28:23.745544','4b1d28f0-c6d5-4a3e-b3a0-2b4b8de73df5',2),('0b193662-94d7-43ea-a673-aa5013dd8c4e','Return to medium heat and add remaining florets. Cover pot and cook until bright green, another 3–5 minutes. Add 2 cups cheddar cheese and stir until smooth. Cover and reduce heat to low; set aside while you make the cheddar croutons.','2022-04-06 02:25:08.969626','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',7),('0bb81c7e-1e98-4c4e-8aba-b48ecb63e192','Cover bowl with a light cloth and allow to rise in a warm place 30 minutes.','2022-05-19 20:30:29.157368','ffdf0b8f-8079-4fb9-ad6c-01fbf51b98c0',5),('0bd5a64c-02bb-4b9a-8735-1c44f32c7506','Pour the bowl of wet ingredients into the bowl of dry ingredients and stir just until combined. The mixture should be thick, but still pourable, and a little bit lumpy. Let the batter rest for 15 minutes.','2022-05-16 02:23:50.646289','82e3139c-d8a3-4b0b-9af6-3fde45528c2e',3),('0c3c9849-8e1a-4504-9bfc-ad399e055a4c','Heat broiler. Broil 4 thick slices rustic white bread (if using) on a rimmed baking sheet until lightly browned (watch closely: broilers vary dramatically in power!), 2–3 minutes. Turn bread over (soft side up), then sprinkle with reserved cheddar cheese and a few flecks of red pepper flakes. Continue to broil until cheese is bubbling and browned in spots, 2–3 more minutes.','2022-04-06 02:25:08.977155','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',8),('0fa2e44f-75aa-4454-a033-8f4d9f518dee','Allow to cool on a wire rack. Invert to remove. Slice and serve!','2022-05-19 20:29:33.578989','fea8dffe-d6a9-49d6-b107-3176cd45d5f1',6),('0fa7e8bc-312a-4aa1-ae45-24d2e4e8fe09','Tear bacon into large pieces and scatter over cabbage. Top with chives, mild red pepper flakes, and sesame seeds as desired.','2022-04-06 02:21:38.578338','a3b6891b-fad3-4c7a-9240-cbd0cb2fb132',4),('103b784c-1a73-40ba-8d87-057d717f6cdc','Roast, tossing occasionally, until tender and browned, 35–45 minutes.','2022-04-06 02:15:44.974550','f3248d19-b91e-46da-b3ab-8735aac7c391',2),('11e20145-494a-4145-93ff-d1517fa97621','Place racks in upper and lower thirds of oven; preheat to 350°. Put powdered sugar in a shallow bowl. Using a #30 cookie scoop (about 2 Tbsp.) and working one at a time, scoop out portions of dough and roll into balls (you should have about 12). Working quickly, roll balls in powdered sugar to coat. Divide between 2 parchment-lined baking sheets, spacing about 3\" apart.','2022-04-06 02:19:07.170709','ba62229e-0ab7-4b07-b4e8-de3b7d876f3b',3),('127ec4eb-fe3d-4063-938a-d3fee7a0edb8','Bake shortbread until top and edges are golden brown, 13–17 minutes. Transfer to a wire rack and let cool.','2022-04-06 02:18:41.089851','a3e3c39d-34f8-42b7-9727-3711233f1bce',3),('154f20c2-41d1-40d2-a3e5-72916e122ec8','Place the beans, onions, and parsley in a bowl, then pour the vinaigrette over top. Stir to combine. Taste and adjust the salt or pepper to your liking. ','2022-05-16 02:45:37.402660','cebd3d9c-966e-4674-bbc8-72db0b3f0429',3),('166450f4-3ed5-482b-9374-48feafc00f17','Preheat oven to 425 degrees.','2022-05-19 20:32:17.313235','cf22cdce-1dc5-4e1b-8ebf-a5adbf71cf48',1),('16a926ed-34d2-438c-bc11-cd066188cec4','Spread out mini marshmallows on the baking sheet in an even layer, and put under the broiler until browned and toasted, about 30 seconds. Remove from heat and allow to cool.','2022-04-06 02:05:00.848411','1be483a2-eafd-4db8-bc19-f45b9efb8a3c',2),('192237b5-86fa-4f36-b4d2-b5b9614e22b4','Place almonds in a frying pan. Toast over medium-high heat, shaking frequently. Watch carefully, as they burn easily.','2022-04-06 02:07:43.777339','fd273271-21a1-43b1-b0bb-4e8c22c19b21',1),('19f6d713-aa8a-48ad-a89c-5f51bce9ac65','Add the drained pasta to the skillet, stir to combine, and remove from the heat.','2022-05-16 02:48:06.096028','b89a90c2-c036-4ab6-881d-27ab1f5a7b9a',5),('1bca55e6-515a-4681-b06a-da467f523618','Strain tea through a fine-mesh sieve into mugs; discard spices and tea bags.','2022-04-06 02:14:48.685072','15b901f9-3232-4f6e-9664-a243c932fe32',2),('1c39ea35-3204-42ba-aa6e-d7055c369176','Store in the fridge for up to 2 weeks.','2022-03-06 02:44:19.131298','3cd3f061-f3bc-4042-84c6-bb5f13722996',2),('1f107ba3-5452-4f9a-baf3-6f8b402ef73a','Mix flour and salt. Create a well.','2022-05-19 20:30:29.145539','ffdf0b8f-8079-4fb9-ad6c-01fbf51b98c0',3),('202f05e7-315d-413e-91ea-9d36cae9b5a0','Sprinkle the yeast over warm milk in a bowl (no more than 100 degrees F). Let is stand 15 minutes.','2022-05-19 20:30:29.132342','ffdf0b8f-8079-4fb9-ad6c-01fbf51b98c0',1),('21808e6b-4eba-4f2b-aee8-4cb65f7b038b','Add minced garlic to butter mixture (the flavor will marinate into the chicken as it makes).','2022-05-19 20:32:17.338359','cf22cdce-1dc5-4e1b-8ebf-a5adbf71cf48',5),('22201388-2641-41c3-becf-7d71ef1d1cd8','Reduce heat to low, add garlic stirring for 1 minute.','2022-05-19 20:32:17.325416','cf22cdce-1dc5-4e1b-8ebf-a5adbf71cf48',3),('231f581d-07d5-4bf7-bcf7-fa4ae3ec6719','Using the dough hook attachment on your mixer, knead while gradually adding in up to 1 cup flour until the dough forms a ball and pulls aways from the edges of the bowl. You can also knead by hand.','2022-05-19 20:29:51.929950','394c735f-fc64-4257-b506-d5a74283ffdf',3),('23cf5afc-9873-49c3-9108-775be0ae6142','Whisk milk, eggs, vanilla, cinnamon, and salt together in a shallow bowl.','2022-03-20 22:14:34.285818','b4191208-a0a1-4ea3-a1ce-e6cdeca0af94',1),('25347f7a-62ae-4240-9bb0-8cc872a2ccc7','Lightly whisk the eggs in a small bowl. Heat a large skillet over medium. Once hot, add 2 Tbsp of cooking oil and swirl to coat the surface. Add the eggs and gently scramble until cooked through. Transfer the cooked eggs to a clean bowl or plate.','2022-04-06 02:11:05.492358','e60e7c73-32ac-4170-916e-6a8a0733070c',2),('253af49f-e417-4c8f-bbb5-b8f5e2426b0d','Chill salad before serving, at least 30 minutes.','2022-04-06 02:09:06.042046','fcd030aa-35d1-4f31-95d6-f2bb0bd7c902',3),('267b213a-c896-4228-87f2-842774bce2c0','Stir in pearl sugar.','2022-05-19 20:30:29.164679','ffdf0b8f-8079-4fb9-ad6c-01fbf51b98c0',6),('273c31a1-c266-4ee4-920f-7e3ab2bdeb30','Divide pasta among bowls. Season with pepper, then top with reserved lemon zest strips.','2022-04-06 02:12:34.841254','dd51b859-f756-4e11-8be5-f6209bb068e8',5),('28be0da6-1114-4b36-9a6b-81fdc9b8db86','Add chickpeas to stew and let simmer for approx. 10 min. Before serving, add kale and salt to taste. Serve with fresh herbs and lemon juice. Enjoy!','2022-03-06 00:56:49.906658','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',5),('2b729110-f28d-4b0a-b74b-44e8a23f807a','Place whole romaine leaves (for the ideal mix of crispness, surface area, and structure) in a large bowl. Use a vegetable peeler to thinly shave a modest amount of Parmesan (a mound of grated Parmesan may look impressive, but all that clumpy cheese mutes the dressing). Use your hands to gently toss together the lettuce, croutons, and dressing. Top with the shaved Parm.','2022-04-06 02:11:29.443876','f5762675-fe7e-4f23-83da-e8f379b8fef7',4),('2bfa364f-0fb9-4648-8c47-3346b280a492','In a sealable jar, bag or small mixing bowl, combine olive oil, lemon juice, onion powder, garlic, salt and pepper. Shake or stir to combine. Add chicken to bag or casserole dish and cover with marinade. Refrigerate covered for 30 minutes or up to 24 hours.','2022-05-19 20:34:16.151519','81ecff09-f4d5-46c7-86d6-15489f1069aa',1),('2ef48dda-4dbc-441f-b809-c25390a247b4','Halve 2 onions. Peel and coarsely chop. Peel and smash 4 garlic cloves, then coarsely chop. No need to break out your best knife skills because it’s all going to get blended, but try to cut everything into somewhat even pieces so they cook at the same rate.','2022-04-06 02:25:08.932201','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',1),('2fdd3366-acf9-4ccd-9c8f-babc4f87f04e','Lightly butter a griddle and heat over medium-high heat.','2022-03-20 22:14:34.289586','b4191208-a0a1-4ea3-a1ce-e6cdeca0af94',2),('305b9b2a-b47d-439d-b1cb-a930f2863d8f','In a jar (or bowl with a whisk) combine apple cider vinegar, olive oil, dijon mustard, salt, pepper, minced garlic and sugar.','2022-05-19 20:38:38.373066','9bfae3cc-3cda-4945-b352-cfa9b2aea8a6',1),('309c2d8e-e04d-48fb-ac78-273e07057903','Top the pasta with Parmesan, salt, pepper, crushed red pepper, and crumbled bacon. Stir to combine. Taste and adjust the salt and pepper to your liking. ','2022-05-16 02:48:06.100748','b89a90c2-c036-4ab6-881d-27ab1f5a7b9a',6),('31a2c5db-3b93-4c37-a2a7-ee9c7bfdb7b1','Bring milk and cinnamon to a simmer in a medium saucepan over medium-low heat, whisking occasionally and making sure milk doesn’t boil, until cinnamon is floral and fragrant, about 10 minutes. Whisk in chocolate, sugar, and salt and cook, whisking frequently, until mixture is smooth and creamy and chocolate is melted, about 5 minutes. Pour through a fine-mesh sieve into a large measuring cup; discard cinnamon.','2022-04-06 02:17:33.573652','6c629135-2f44-49dd-bb25-0141b773a34e',1),('31ece88d-7901-403a-af95-5328ac594a94','Over medium heat, add shallots and olive oil. Cook until translucent and lightly brown (about 10 minutes).','2022-05-19 20:32:17.319205','cf22cdce-1dc5-4e1b-8ebf-a5adbf71cf48',2),('320270d5-3f81-4da3-818e-a2ccd15269f9','In a large bowl, toss cabbage with dressing.','2022-05-19 20:38:38.378811','9bfae3cc-3cda-4945-b352-cfa9b2aea8a6',2),('325bd357-c55c-4914-81e0-5db769086db4','Combine milk and vinegar in a bowl and set aside for 5 minutes to \"sour\" the milk. You are essentially making your own buttermilk with this step.','2022-04-03 00:48:58.071747','dd24945a-27fb-47d8-994f-7470d8aaf38a',1),('34e82b2e-24c2-482c-af1a-d0b223f53cb9','Bring 6 cups water to a boil in a medium pot or tea kettle. Add tea bags, cardamom, cinnamon, sugar, and vanilla extract and return to a boil. Stir in evaporated milk and return to a boil again, watching carefully to ensure the tea doesn’t boil over. Reduce heat to medium-low and simmer until thick, creamy, and caramel in color, about 30 minutes. (The longer the tea simmers the stronger and creamier it will be.)','2022-04-06 02:14:48.680170','15b901f9-3232-4f6e-9664-a243c932fe32',1),('353a7717-3b19-464b-a739-1997983abf5e','Add the yogurt or mayonnaise, the mustard, a couple generous pinches of salt and pepper, celery, onion, and lemon juice. Mash with a fork. Don\'t completely overdo it, you want the egg mixture to have some texture. If you need to add a bit more yogurt to moisten up the mixture a bit, go for it a bit at a time. Taste, and adjust the seasoning - adding more salt and pepper if needed.','2022-03-13 23:39:14.291093','fed3dedf-43b3-4de5-9433-6028e601bcf1',3),('3593f2e4-4e96-413d-af14-35a549ea467f','Bake in the preheated oven until the top springs back lightly when touched, 35 to 40 minutes. Allow cake to cool in the pan for 10 to 15 minutes before transferring to a wire rack to cool completely.','2022-04-06 02:05:00.879815','1be483a2-eafd-4db8-bc19-f45b9efb8a3c',7),('360df65c-9dd6-4f1b-b5e8-b821b3a92478','Prep – Slice and cube brie.','2022-05-19 20:28:08.524804','7feccd51-f092-423c-b7af-c269b5d2376d',2),('3672aa01-db9d-4d8a-8ce8-09df8f8b118a','Whisk oil, blood orange juice, lime juice, honey, salt, and pepper in a small bowl to combine; mix in shallot and cilantro.','2022-04-06 02:22:34.198095','5bab4042-9684-4fae-ad3b-5f5de9350580',1),('368105ce-72b6-43aa-a63b-0fe9f833eec5','Cut cheese toasts (if using) into 1\" (spoon-sized!) pieces. Divide soup among bowls. Top with cheddar croutons or reserved cheese.','2022-04-06 02:25:08.989088','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',10),('372551b4-b21c-4034-ab7d-aea00957ea96','Squeeze out rehydrated mushrooms over bowl to catch soaking liquid; thinly slice mushrooms.','2022-04-06 02:13:49.597483','3107980b-9142-415e-9b29-b1ffe0e24119',2),('37e4ed9f-777b-4b41-a13a-7932ba783992','If you want to use this with pasta, cook 12 oz. dried pasta (we prefer long pasta for pesto) in a large pot of boiling salted water, stirring occasionally, until al dente. Drain, reserving ½ cup pasta cooking liquid.','2022-04-06 02:15:22.656188','2e0c1573-6f3b-4c6b-90e4-5dff011b9673',3),('39b76e0f-5c48-46ff-a1b7-78f2c08f3cae','Peel and slice beets.','2022-05-19 20:38:59.576690','1bef0910-4cea-428d-adcc-3de1e4c24774',5),('3ad21923-ada9-4702-bc8f-0e615cf24a64','While the lentils are cooking, heat 2 Tbsp. extra-virgin olive oil in a small saucepan over medium. Cook 4 garlic cloves, thinly sliced, stirring often, until golden and starting to crisp, about 3 minutes; remove pan from heat. Using a slotted spoon, transfer garlic chips to paper towels, leaving oil behind. Lightly season garlic chips with kosher salt. Stir 1 tsp. Aleppo-style pepper into infused oil in pan and set aside.','2022-04-06 02:24:55.003311','893397cd-a91f-4f09-a179-7376cef82601',3),('3c223aa6-53fe-4ef1-981b-3565db68a3c1','Combine pear, apple, celery, raisins, cranberries, and walnuts in a bowl. Add dressing and toss well to combine. Sprinkle cinnamon and nutmeg on top.','2022-04-06 02:09:06.036813','fcd030aa-35d1-4f31-95d6-f2bb0bd7c902',2),('3d705951-dcd0-4187-a495-c87d08945168','Cut 8 oz. fresh mozzarella into eight ½\"-thick slices. Working with 1 slice at a time, dredge mozzarella in seasoned flour, shaking off excess, then dip in eggs, letting excess drip back into bowl. Dredge in seasoned flour and dip in eggs a second time. Coat in panko, pressing gently to adhere before shaking off excess. Transfer coated mozzarella to a plate as you go.','2022-04-06 02:23:23.783622','85cb832a-a110-46ea-a7db-ccfcfbc883ab',3),('3ddf115d-140e-43fa-95a7-cb173578a883','Whisk egg, butter, and vanilla extract into \"soured\" milk until well combined. Pour flour mixture into the wet ingredients and whisk until just combined. Fold in chocolate chips. Batter will be thick. Allow batter to rest for 5 minutes.','2022-04-03 00:48:58.089417','dd24945a-27fb-47d8-994f-7470d8aaf38a',3),('3f22246c-9185-408a-ba2a-4eb658f872a2','Brown ground beef and onions in a large skillet over medium heat, crumbling as it cooks, until the beef is no longer pink and the onion is soft, about 5 minutes. Drain if necessary.','2022-04-06 02:04:37.610464','35a89094-78da-4931-96cc-d5cbf0f5d6fb',1),('3f311de2-121d-4627-bb93-b64bdfb306bf','Add eggs, bananas and vanilla until just combined.','2022-05-19 20:29:33.537805','fea8dffe-d6a9-49d6-b107-3176cd45d5f1',3),('3f93150a-6428-44d8-a4dc-7183189547ec','Pour hot curd through a fine-mesh sieve onto shortbread crust, using a rubber spatula to scrape off any curd that clings to the bottom of sieve. Spread curd into an even layer, working it all the way to the sides and corners. Tent a sheet of foil over baking dish to cover loosely and bake 12 minutes.','2022-04-06 02:18:41.116286','a3e3c39d-34f8-42b7-9727-3711233f1bce',6),('3fb362de-85d8-44b0-8aba-7ea0c5781723','Just before serving, slice passion fruit bars into 2\" squares and top with spoonfuls of fresh passion fruit or dust with powdered sugar with a fine-mesh sieve if desired.','2022-04-06 02:18:41.137395','a3e3c39d-34f8-42b7-9727-3711233f1bce',8),('40484056-32de-4777-bde1-3f297fc3610e','Add 8 oz. broccolini, halved lengthwise if thick, to broth and cook until bright-green and tender, about 2 minutes. Add cooked noodles or 16 oz. fresh wheat noodles and cook until heated through (and cooked, if using fresh noodles), about 2 minutes. Remove from heat and stir in 1 tsp. unseasoned rice vinegar. Taste soup and season with more salt and vinegar if needed.','2022-04-06 02:24:44.507944','fde67312-80de-43bd-8c1a-196393822bfc',4),('41970346-313e-44b1-9d7f-017317ba4a79','Place a steaming rack or basket in a large pot with a lid (make sure your bowl will fit in the pot when covered with lid). Pour in water to come 2\" up sides of pot and bring to a simmer over medium heat. If using a Tatung steamer instead, add 1 cup water to steamer.','2022-04-06 02:13:49.613874','3107980b-9142-415e-9b29-b1ffe0e24119',4),('4210321f-3b7b-4299-ad32-d11a1c41c272','Spin the spring mix and chop the other ingredients.','2022-05-19 20:33:06.731167','939bd8bb-0de2-4eda-b060-db31bca15902',1),('42138f1a-464f-443e-a2c4-f037db7574ed','Add the remaining 1 Tbsp cooking oil to the skillet and swirl to coat the surface. Add the garlic, ginger, and cooked and cooled rice to the skillet. Stir and cook for about 2 minutes, or until the rice is heated through.','2022-04-06 02:11:05.501951','e60e7c73-32ac-4170-916e-6a8a0733070c',4),('425d7b92-64ae-419c-81ab-c739806d4da2','Blend cacao nib mixture, coconut milk, coconut oil, and remaining 1 Tbsp. sugar in a blender on high speed until smooth and frothy, about 1 minute. Strain through a fine-mesh sieve, dividing between mugs.','2022-04-06 02:17:01.784837','30386c99-cc37-49c8-8110-7eabf566410c',2),('434d5074-1eb9-4f24-909e-5749fee29cd5','Remove soup from heat and stir in ½ cup plain Greek yogurt. Season generously with black pepper; taste for salt.','2022-04-06 02:25:08.983917','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',9),('43ce3f6a-4113-4e3e-b0a8-b14c0ca41a2b','Carefully place bowl with egg mixture into steamer and cover immediately, leaving lid slightly askew for steam to escape. Reduce heat to medium-low and steam, adjusting heat as needed to keep water at a gentle boil, until egg mixture is set and jiggly when shaken, 12–15 minutes. If using a Tatung steamer, place bowl with egg mixture in steamer and cover with lid, propping open with a folded paper towel. Press cook switch and wait until switch bounces back, about 15 minutes.','2022-04-06 02:13:49.619859','3107980b-9142-415e-9b29-b1ffe0e24119',5),('43d010f0-3c0b-4cb1-bb70-91ceecdae4c5','In a mixing bowl, combine 2¼ cup flour, ¼ cup sugar, salt. Add yeast and lukewarm milk mixture. Combine. Add egg.','2022-05-19 20:29:51.920636','394c735f-fc64-4257-b506-d5a74283ffdf',2),('447621c1-b881-4c22-9fc4-12e84d340200','Add the frozen peas and about ¼ cup of the reserved pasta water to the skillet. Continue to cook and stir until the peas have heated through.','2022-05-16 02:48:06.091330','b89a90c2-c036-4ab6-881d-27ab1f5a7b9a',4),('44a5dc51-2a92-4650-a632-040ec3ec2741','In a saucepan over medium heat, add milk and butter. Stir until melted and remove from heat.','2022-05-19 20:29:51.914147','394c735f-fc64-4257-b506-d5a74283ffdf',1),('45e5a05e-512a-4313-9d31-3ab16aa6712f','Meanwhile, whisk yogurt, sesame paste, a pinch of salt, remaining 1 tsp. lime juice, and remaining 1 tsp. honey in a small bowl until smooth.','2022-04-06 02:21:54.156602','666a0b5b-90a1-427b-940e-9316d3b67ef8',3),('4644f5d4-d178-4022-9f8e-ad24fcf81edd','Beat heavy cream until foamy and thick. Beat in mascarpone until it starts stiffening.','2022-05-19 20:27:47.773001','ff6a2ccb-5173-4dbb-ac23-c98e9547488e',1),('4e96acbb-6620-490c-a307-345686ea86de','Repeat with the remaining batter, adding more oil to the skillet between batches or as needed, until all of the pancakes have been cooked. Keep the pancakes warm on a plate under a towel or in a warm oven until all of the pancakes have been cooked. Serve warm with your favorite toppings!','2022-05-16 02:23:50.668514','82e3139c-d8a3-4b0b-9af6-3fde45528c2e',6),('5194c221-0fe6-4652-8ca4-3a1a042574e4','Toss beets in olive oil. Arrange on sheet pan so they are not touching.','2022-05-19 20:38:59.541690','1bef0910-4cea-428d-adcc-3de1e4c24774',2),('5208e71b-ea54-4f75-ad84-5bc6d27637ee','In a large bowl, combine iceberg, romaine, artichoke hearts, onion, and pimentos.','2022-05-19 20:32:52.043705','940ecc52-6188-4754-b2c6-3a9d5a8aedcf',1),('52cae64f-e87c-477b-b7e8-377513c83604','Combine the steak seasoning, smoked paprika, and sweet paprika in a bowl. Coat the chicken breasts liberally with the seasoning on all sides.','2022-05-16 02:25:01.268938','0188bb5a-f031-4809-87e7-cf6931c72c37',1),('55b15dd9-0d50-4a77-9f85-289d119af6ba','Pour batter into prepared pan. Bake 55 minutes or until a toothpick comes out clean.','2022-05-19 20:29:33.571116','fea8dffe-d6a9-49d6-b107-3176cd45d5f1',5),('57d6a278-2351-4009-8288-b5af6b7e7cb4','Brush chicken with olive oil on both sides.','2022-05-19 20:31:56.629679','0ea538fd-b630-45d3-ad65-3000ecf489c9',2),('58b90540-1131-4fdc-a10d-171bc336b574','Preheat oven to 450°. Toss potatoes, oil, salt, and pepper on a rimmed baking sheet.','2022-04-06 02:15:44.960065','f3248d19-b91e-46da-b3ab-8735aac7c391',1),('5d4e0098-c728-482c-a80f-aa8f544b2c6c','Add the cinnamon and nutmeg to the pot and continue to stir and cook for 30-60 seconds more.','2022-05-16 02:44:19.876498','8c44b28b-2114-44bd-baf2-12fc7a2fe49e',2),('5d8fd2ca-40bd-4210-8251-cbf86c2e6cbb','Return pot to medium-low heat. Add 1 large onion, finely chopped, and cook, stirring often, until softened and translucent, about 3 minutes. Add one 2\" piece ginger, finely grated, and 4 garlic cloves, finely grated, and cook, stirring, until fragrant, about 1 minute. Add ¼ cup nutritional yeast and 1–2 Tbsp. chickpea miso or yellow miso (see headnote) and cook, stirring to coat, 30 seconds. Add 6 cups water, 1 tsp. Diamond Crystal or ½ tsp. Morton kosher salt, and remaining chickpeas and bring to a boil. Reduce heat, partially cover, and simmer gently, stirring occasionally, until flavors have melded, 15–20 minutes.','2022-04-06 02:24:44.495353','fde67312-80de-43bd-8c1a-196393822bfc',2),('5ed754b0-51f4-465f-89dc-9bcf08c4a227','Top with icing and serve.','2022-05-19 20:29:51.956565','394c735f-fc64-4257-b506-d5a74283ffdf',7),('60e1012f-98d7-4178-8bab-b7c14f1f62c3','Bring a pot of water to a boil for the pasta. Once boiling, add the pasta and continue to boil until the pasta is tender (7-10 minutes). Reserve about a half cup of the starchy pasta water before draining the pasta in a colander.','2022-05-16 02:48:06.071662','b89a90c2-c036-4ab6-881d-27ab1f5a7b9a',1),('617049cd-967e-4012-b9d1-854beb4c5bdd','While the pasta is boiling, cook the bacon. Add the bacon to a large skillet and cook over medium heat until brown and crispy. Transfer the cooked bacon to a paper towel lined plate with a slotted spoon. Drain most of the bacon grease from the pan, leaving about 2 Tbsp.','2022-05-16 02:48:06.079830','b89a90c2-c036-4ab6-881d-27ab1f5a7b9a',2),('618363ea-bd6d-4002-8754-8f28efe128c9','Place apples, celery root, grapes, and walnut pieces in a large bowl. Toss with about 1/2 cup of dressing. Add more dressing until salad components are well coated but not swimming in dressing. You might not need all the dressing.','2022-04-06 02:09:23.086392','dcfd256e-b215-4d56-9502-9fd095113a11',2),('61c5f939-ff1f-4d7e-8ff9-a92ef4a507be','Assemble the Coleslaw:','2022-03-20 23:18:49.367968','6570af5a-e811-45b8-a533-c4f06438e1ff',3),('6251bdb8-7d1b-48a9-8de0-83ebc03f758e','Meanwhile, prepare quinoa according to package instructions, boiling it with the cider vinegar and some of the lemon juice. When little white rings begin to form around the grains, drain any excess water and set quinoa aside.','2022-03-06 00:56:49.904226','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',4),('635f5bc7-953a-4e35-aec8-b550aa2fa8a2','Quarter iceberg lettuce through the stem end. Remove any tired outer leaves. Tuck jalapeños and ½ cup herbs between lettuce leaves, dividing evenly. Tuck 2–3 pieces mortadella into each wedge; season with salt and pepper. Finely grate zest of lemon over wedges, then cut lemon in half.','2022-04-06 02:22:09.795390','1d732269-5ba6-4e29-a127-da0a2b6fa54f',1),('643b7dea-4375-44ca-bfd8-07b252c79480','Add half of florets to pot, cover, and cook until bright green, 3–5 minutes. Transfer to a blender, let cool for 5 minutes, and purée until smooth. Some blender advice: Don\'t fill your blender more than halfway—work in batches as necessary. To avoid explosions, remove the center lid from the blender and cover with a kitchen towel. Alternatively, use an immersion blender. Your soup won’t be quite as smooth, but it will still be great. Return purée to pot.','2022-04-06 02:25:08.964037','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',6),('6532ad90-1202-44c5-b4e0-804c65d83453','Mix all ingredients together in a bowl, Season with sat and pepper, to taste.','2022-03-06 02:44:19.127485','3cd3f061-f3bc-4042-84c6-bb5f13722996',1),('675b343a-22bf-478a-912a-00ba6d6c8217','Working with one baking sheet at a time, bake cookies until golden brown around the edges, 13–15 minutes. Let cookies cool 5 minutes on baking sheets, then transfer to wire racks and let cool completely.','2022-04-06 02:18:29.970006','d1466bc9-050b-425e-ad8e-af0675f32354',4),('678994de-fc6f-4956-aae9-bcd470b8cc23','Using an electric mixer, beat eggs, oil, tahini, and vanilla in a large bowl on medium speed until creamy and emulsified, about 2 minutes. Beat in granulated sugar and brown sugar until combined, about 45 seconds. Reduce speed to low and beat in dry ingredients, chopped dates, and three quarters of chocolate, scraping down sides of bowl as needed, just until combined, about 30 seconds. Cover dough and chill at least 3 hours and up to 12 hours.','2022-04-06 02:18:29.961275','d1466bc9-050b-425e-ad8e-af0675f32354',2),('697959d6-1553-4ce4-bb95-ee8d4f470a5b','Whisk together the flour, baking powder, and salt in a bowl.','2022-05-16 02:23:50.628668','82e3139c-d8a3-4b0b-9af6-3fde45528c2e',1),('6afd4480-ca90-447c-9c9d-01e375c16a81','Place the eggs in a pot and cover with cold water by a 1/2-inch or so. Bring to a gentle boil. Now turn off the heat, cover, and let sit for exactly eight minutes. Have a big bowl of ice water ready and when the eggs are done cooking place them in the ice bath for three minutes or so - long enough to stop the cooking. Crack and peel each egg, place in a medium mixing bowl.','2022-03-13 23:39:14.289506','fed3dedf-43b3-4de5-9433-6028e601bcf1',2),('6c3b8e6a-f80d-4390-bbfe-4250aad13f6f','There should be a good amount of oil left in the skillet. Turn the heat up to medium-high. Add the diced carrots and stir and cook for about two minutes. Next add the bell pepper and the white firm ends of the green onions. Cook and stir for one minute more. Finally, add the frozen peas and stir and cook until heated through. Transfer the vegetables to a clean bowl or plate. ','2022-04-06 02:11:05.497328','e60e7c73-32ac-4170-916e-6a8a0733070c',3),('6d4d2744-97c7-4df1-9b93-88a6636d74ad','Blend the blueberries, yogurt, milk, sugar, vanilla, and nutmeg in a blender until frothy, scraping down the sides of the blender with a spatula occasionally. Serve immediately.','2022-04-06 02:06:13.018784','87c7f114-0945-4706-b90f-76de7818c35b',1),('6e7d220d-b080-4274-9918-d6bd7dcd0139','In a separate bowl, whisk together the milk, egg, melted butter, sugar, and vanilla extract.','2022-05-16 02:23:50.639806','82e3139c-d8a3-4b0b-9af6-3fde45528c2e',2),('70022cb3-1bf7-4577-afd5-6f4764afb8a9','Cream together toasted mini marshmallows, butter, oil, sugar, and marshmallow crème in a large bowl with an electric mixer until thoroughly incorporated and smooth, 2 to 3 minutes. Beat in egg whites, 1 at a time, mixing well after each addition. Mix in vanilla and almond extracts. Stir in half of the flour mixture until just combined. Mix in buttermilk until just combined. Stir in remaining flour mixture until just combined.','2022-04-06 02:05:00.866141','1be483a2-eafd-4db8-bc19-f45b9efb8a3c',5),('707e3c0e-e3fe-427a-bc13-7c8b46f4c2b4','Place mushrooms in a medium bowl and pour in 1½ cups hot water to cover. Let sit 30 minutes to rehydrate.','2022-04-06 02:13:49.592917','3107980b-9142-415e-9b29-b1ffe0e24119',1),('71a20c1a-0ed1-4dcb-818b-ac2812f00a94','Remove soup from heat and stir in 1 cup torn mixed tender herbs (such as basil, dill, cilantro, and/or parsley). If soup is too thick, thin with water. Taste and add up to ½ preserved lemon, rinsed, seeds removed, finely chopped, if desired (you may find the soup lemony enough as it is). Season with more salt if needed.','2022-04-06 02:24:55.010908','893397cd-a91f-4f09-a179-7376cef82601',4),('72a2fecf-c4df-44e7-b477-9a1d2db7c2fe','Meanwhile, chop reserved florets into small pieces (you can take the time to separate them into baby florets or just have at them with your chef’s knife). Grate 8 oz. sharp cheddar cheese on the large holes of a box grater. You should have about 2 1/2 cups.','2022-04-06 02:25:08.957335','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',5),('72d735e4-7306-4dff-8e87-f9796f629646','Grind the sesame seeds in a mortar and pestle or by pulsing in a food processor or blender until it is a fine meal. Add the tahini, lime juice, coco aminos or soy sauce, mirin, sugar, and sriracha. Stir until well combined. Stir in the warm water and stir, stir, stir, until creamy and uniform. Taste and add more sriracha of you like.','2022-03-20 23:18:49.366193','6570af5a-e811-45b8-a533-c4f06438e1ff',2),('7399bcfb-b054-4cbd-b047-dd9fe7dd9fae','Rinse and drain the cannellini beans. Thinly slice the red onion and roughly chop the parsley.','2022-05-16 02:45:37.384529','cebd3d9c-966e-4674-bbc8-72db0b3f0429',2),('75c34f90-e445-4562-8585-9a9495aa4efd','Transfer tomato mixture along with any accumulated juices to a blender. Add 3 Tbsp. oil and purée on medium speed until smooth; season with salt and vinegar, if desired. Strain through a coarse-mesh sieve into a large bowl or pitcher and chill until cool, about 1 hour.','2022-04-06 02:25:28.559262','f852a4dc-e20b-4a41-acd6-789db0813143',2),('7649a416-874f-40e9-b315-e0328e3f8cb4','Transfer dough to prepared pan (you may find it easier to form into a ball first instead of working with clumps—entirely up to you) and press into pan in an even layer, working it all the way to the sides and corners.','2022-04-06 02:18:41.080867','a3e3c39d-34f8-42b7-9727-3711233f1bce',2),('76e79af8-f4eb-4fac-a055-06882af31249','Reduce oven temperature to 325° and remove foil from pan. Continue to bake bar until sides of curd are set but center still jiggles slightly when pan is gently shaken, 8–10 minutes more. Transfer pan to a wire rack and let bar cool, about 1 hour. Cover pan tightly with plastic wrap and chill at least 3 hours before serving.','2022-04-06 02:18:41.131251','a3e3c39d-34f8-42b7-9727-3711233f1bce',7),('790a4186-0aeb-4d86-9819-24bf1cecef23','Pour batter into the prepared cake pan, and spread into an even layer.','2022-04-06 02:05:00.872893','1be483a2-eafd-4db8-bc19-f45b9efb8a3c',6),('79cb92f4-74ac-4e74-bfc5-2e5be8721799','Cover cacao nibs, coconut flakes, salt, and 1 Tbsp. sugar with 2 cups boiling water in a medium heatproof bowl. Let steep, uncovered, 5 minutes.','2022-04-06 02:17:01.776913','30386c99-cc37-49c8-8110-7eabf566410c',1),('7bdd9b79-d8e4-48e8-b82b-4076d1446075','Chop together anchovy fillets, garlic, and pinch of salt. Use the side of a knife blade to mash into a paste, then scrape into a medium bowl. Whisk in egg yolks, 2 Tbsp. lemon juice, and mustard. Adding drop by drop to start, gradually whisk in olive oil, then vegetable oil; whisk until dressing is thick and glossy. Whisk in Parmesan. Season with salt, pepper, and more lemon juice, if desired.','2022-04-06 02:11:29.425844','f5762675-fe7e-4f23-83da-e8f379b8fef7',1),('7da307f1-9887-44e0-b2c4-5de9c7982ba5','In a large bowl, combine butter lettuce, onion, apples, green onions and blue cheese.','2022-05-19 20:32:37.842922','65f1e09c-5981-4745-a266-f75af9a2d902',1),('7fc9f81d-2bce-4be9-940c-612f8a8ac6fd','Fill – Fill shells with sliced fruit, jams, jellies, nuts and of course, brie.','2022-05-19 20:28:08.538120','7feccd51-f092-423c-b7af-c269b5d2376d',3),('805b8cd8-7188-46f8-821b-af9371d43a73','Toss with dressing and parmesan.','2022-05-19 20:32:52.059000','940ecc52-6188-4754-b2c6-3a9d5a8aedcf',3),('80899ed9-969a-4e62-b54c-0fbc946e5189','Place a rack in middle of oven and preheat to 350°. Line an 8x8\" baking pan, preferably metal, with overlapping sheets of parchment paper, leaving generous overhang on all sides. Whisk flour, granulated sugar, salt, and baking powder in a large bowl to combine. Add butter and vanilla and mix with a rubber spatula until butter is evenly distributed. The dough should stick together in clumps while still remaining crumbly.','2022-04-06 02:18:41.073664','a3e3c39d-34f8-42b7-9727-3711233f1bce',1),('820c9dcc-f274-49ac-b962-fa29d2fd6b60','Meanwhile, purée olive oil, vinegar, miso, tahini, onion powder, soy sauce, sesame oil, and 2 Tbsp. water in a blender until smooth; season with salt and pepper.','2022-04-06 02:21:38.567427','a3b6891b-fad3-4c7a-9240-cbd0cb2fb132',2),('822df01b-ce2b-403a-8d7d-502a7cfebed1','While the shortbread is cooling, whisk flour, cream of tartar, and salt in a small bowl to combine. Vigorously whisk eggs, egg yolks, passion fruit juice, lemon juice, and granulated sugar in a large saucepan just to combine. Add dry ingredients and whisk to incorporate.','2022-04-06 02:18:41.101147','a3e3c39d-34f8-42b7-9727-3711233f1bce',4),('847612cc-32dd-415c-be0b-82ff79f66047','Add 8 cups good-quality low-sodium vegetable or chicken broth and 2 cups red lentils, rinsed, and bring to a boil, skimming foam from surface as needed. Reduce heat to medium-low, partially cover, and simmer, stirring occasionally, until lentils are very tender and soup is almost creamy, 35–45 minutes.','2022-04-06 02:24:54.997865','893397cd-a91f-4f09-a179-7376cef82601',2),('84b018a5-ced0-47cc-bb94-ecbfac1db9b6','Place chicken breasts in baking dish. Combine butter and wine, pour over chicken.','2022-05-19 20:32:17.332683','cf22cdce-1dc5-4e1b-8ebf-a5adbf71cf48',4),('8510ee81-bc32-4ae3-9984-9fb09c811fc8','Whisk eggs, butter and vanilla into yeast mixture until blended. Set aside.','2022-05-19 20:30:29.139496','ffdf0b8f-8079-4fb9-ad6c-01fbf51b98c0',2),('8567ecca-cd87-424d-bce7-45f3efaba312','Allow chicken to rest 10 minutes before serving or slicing.','2022-05-19 20:31:56.672318','0ea538fd-b630-45d3-ad65-3000ecf489c9',5),('876cc651-5364-4fcc-be6e-feb92ef8c973','Cook bacon in a single layer in a large skillet over medium heat, turning occasionally, until browned and crisp, 10–12 minutes. Transfer to paper towels and let cool.','2022-04-06 02:21:38.560673','a3b6891b-fad3-4c7a-9240-cbd0cb2fb132',1),('87f21dc5-4dac-4240-a582-d93cba718792','Just before serving, toss salad with dark green scallion parts and shiso. Spread yogurt mixture over a shallow bowl. Using tongs, mound salad on top, leaving behind any liquid in bowl. Scatter sesame seeds and reserved quinoa over.','2022-04-06 02:21:54.166460','666a0b5b-90a1-427b-940e-9316d3b67ef8',4),('88e83935-918c-4f50-bfe1-7c868765da99','In a large pot, heat the olive oil over medium heat. Add onion and garlic and sear quickly. Lower heat, add all of the spices, and sauté for approx. 2 min. Add sweet potatoes, carrots, bell pepper and fennel and sauté for approx. 2 more min.','2022-03-06 00:56:49.901238','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',2),('8a9fa50f-27a6-4f3b-8a0c-544a75573a82','Move steak over indirect heat (still positioning tenderloin side away from the heat) and grill, turning every 1–2 minutes and moving closer to or farther away from heat as needed to build even color, until an instant-read thermometer inserted into the thickest part of steak registers 120° for medium-rare, 10–12 minutes. Transfer to a wire rack set over a rimmed baking sheet and let rest 15–30 minutes.','2022-04-06 02:16:10.560137','e89aaa1b-efd1-444b-a26d-76f2c8a70e12',3),('8d4fc118-3827-4220-a98b-8858e2f7c5f7','Using a vegetable peeler, remove two 2\"-long strips of lemon zest. Thinly slice each strip lengthwise into thin strands; set aside for serving. Finely grate remaining zest into a large pot (like a Dutch oven). Cut lemon in half and squeeze out enough juice to yield 2 Tbsp. into a small bowl; set aside.','2022-04-06 02:12:34.801401','dd51b859-f756-4e11-8be5-f6209bb068e8',1),('8dc59338-86c5-4190-8491-ca3845872661','Combine flour, sugar, baking powder, baking soda, and salt in a large mixing bowl.','2022-04-03 00:48:58.080660','dd24945a-27fb-47d8-994f-7470d8aaf38a',2),('8e0a9fd2-a0e4-488c-8a96-0ce8c9dee4a8','Do ahead: Dough can be made 3 days ahead; cover and chill. Cookies can be made 4 days ahead; store airtight at room temperature.','2022-04-06 02:19:07.198054','ba62229e-0ab7-4b07-b4e8-de3b7d876f3b',5),('8ebcc2af-48eb-42a5-9b9a-c5afba60d997','Squeeze juice from remaining lemon half over wedges (seek to get cut sides completely drizzled in lemon juice). Drizzle dressing over and finish with a grind or two of pepper and more herbs.','2022-04-06 02:22:09.810485','1d732269-5ba6-4e29-a127-da0a2b6fa54f',3),('90006e30-eb9e-47d9-8585-758465557ba0','Meanwhile, trim bottoms of 2 heads of broccoli, then peel. Separate hefty stalks from florets (the thin, little stalks attached to broccoli tops are fine to leave attached to the crowns). Set aside florets. Coarsely chop stalks into 1\"–2\" pieces. Peel 1 medium russet potato. Coarsely chop into 1\"–2\" pieces.','2022-04-06 02:25:08.944785','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',3),('901e5a2e-e5d0-4c81-9ef6-1f05b6ea471c','Serve the rice pudding warm or refrigerate and serve cold the next day.','2022-05-16 02:44:19.923633','8c44b28b-2114-44bd-baf2-12fc7a2fe49e',5),('90811895-a613-4d96-ae05-7ffc65856f06','Heat a large skillet or griddle over medium. Once hot add enough cooking oil to coat the surface (I use about ½ tsp per pancake). Add the pancake batter to the hot griddle, ¼ cup at a time. Use the back of the measuring cup to spread the batter into a 4.5-inch diameter circle.','2022-05-16 02:23:50.654104','82e3139c-d8a3-4b0b-9af6-3fde45528c2e',4),('90df7ce7-9709-4b5e-902e-906fac4f217c','Pour the soy sauce and toasted sesame oil over the rice. Stir the rice and sauce together until evenly combined. Turn the heat off.','2022-04-06 02:11:05.507208','e60e7c73-32ac-4170-916e-6a8a0733070c',5),('93ca93c3-9a06-4f45-a720-19b150216316','Transfer to a cutting board and cut meat away from each side of the bone, then slice crosswise. Serve topped with sauce and reserved peppercorns.','2022-04-06 02:16:10.567777','e89aaa1b-efd1-444b-a26d-76f2c8a70e12',4),('9580c945-254e-41fb-9280-71319dfb0f1f','Pour about ¼ cup of batter for each pancake onto the skillet. Cook until bubbles appear on the surface, 2 to 4 minutes. Flip pancake with a spatula, and cook until browned on the other side, 2 to 3 more minutes. Repeat with remaining batter. Serve immediately.','2022-04-03 00:48:58.095745','dd24945a-27fb-47d8-994f-7470d8aaf38a',5),('95cb7f3f-ede1-4f04-9c15-f2935a03371a','Combine dressing ingredients in a jar and shake or whisk together. Toss desired amount with spring salad mix.','2022-05-19 20:33:06.743219','939bd8bb-0de2-4eda-b060-db31bca15902',3),('9778e53c-552b-448b-83c2-86b025020eac','Dunk bread in the egg mixture, soaking both sides. Transfer to the hot skillet and cook until golden, 3 to 4 minutes per side. Serve hot.','2022-03-20 22:14:34.291240','b4191208-a0a1-4ea3-a1ce-e6cdeca0af94',3),('97a0a890-781d-4821-b14d-f97a518eefc8','Divide soup among bowls. Top with cilantro leaves with tender stems (if using), chili oil, and reserved chickpeas.','2022-04-06 02:24:44.513864','fde67312-80de-43bd-8c1a-196393822bfc',5),('97e5ae1a-145e-4d5a-912d-f3224d3d5e89','Sprinkle with sesame seeds and sliced green onion and serve.','2022-04-06 02:04:37.624625','35a89094-78da-4931-96cc-d5cbf0f5d6fb',3),('989e0325-4a1e-44d7-add0-1015e2ffe1e5','Add teriyaki sauce, water chestnuts, pineapple, garlic, and ginger to the skillet; stir to combine. Turn the heat down, and simmer for about 5 minutes.','2022-04-06 02:04:37.617507','35a89094-78da-4931-96cc-d5cbf0f5d6fb',2),('9b070782-6c06-4e6a-9826-3374e9bfc093','Preheat the oven to 325 degrees F (165 degrees C) and place an oven rack in the middle of the oven. Line a 9-inch round cake pan with parchment paper and lightly grease it.','2022-04-06 02:05:00.854226','1be483a2-eafd-4db8-bc19-f45b9efb8a3c',3),('9c454e64-3990-4fea-b203-0a50809226c8','Arrange blood oranges, mangoes, avocados, and cherry tomatoes on a platter. Drizzle dressing over.','2022-04-06 02:22:34.203224','5bab4042-9684-4fae-ad3b-5f5de9350580',2),('9d37093e-4fb5-4d06-86a0-3a7c377145b6','Do Ahead: Slushy can be made 1 hour ahead. Store in blender jar in freezer, then reblend on high speed to reincorporate.','2022-04-06 02:27:10.804741','25c855c1-a417-4c89-8683-1485925a9870',2),('9d9ad7bc-365f-4a8b-b112-9e91480436ba','Combine the cabbages, carrots, apple, scallions, and cilantro in a large bowl. Drizzle with about half of the spicy sesame dressing. Toss until everything is nicely coated, and then toss a bit more. Decide if you want more dressing and add a bit at a time until it is to your liking.','2022-03-20 23:18:49.369226','6570af5a-e811-45b8-a533-c4f06438e1ff',4),('9fa24755-a2f7-44ba-b98d-58ddd4820806','Do ahead: Bars can be baked 3 days ahead. Keep chilled.','2022-04-06 02:18:41.143261','a3e3c39d-34f8-42b7-9727-3711233f1bce',9),('a10960be-63fb-4230-9597-2f97aa315a8f','Add espresso to hot chocolate mixture and stir to combine. Divide among mugs, then top with whipped cream and espresso beans, if desired.','2022-04-06 02:17:33.580136','6c629135-2f44-49dd-bb25-0141b773a34e',2),('a3e6b5df-2eae-4125-b3de-d97459e95c37','Preheat oven to 425 degrees Fahrenheit. Line a baking sheet with parchment paper.','2022-05-19 20:38:59.533230','1bef0910-4cea-428d-adcc-3de1e4c24774',1),('a42f2485-6114-4c20-a5ec-e43d9e24f49e','Divide gazpacho among bowls. Top with cherry tomatoes, chives, reserved cucumber and red pepper pieces, and tomato seeds; drizzle with oil and season with salt. Serve with bread alongside.','2022-04-06 02:25:28.563316','f852a4dc-e20b-4a41-acd6-789db0813143',3),('a4a4329f-3a6e-4f1f-af3f-ba1695481051','Do Ahead: Pesto can be made 1 day ahead. Top with ½\" oil to prevent browning. Store in a covered container (an extra drizzle of oil on top will help prevent oxidation) and chill.','2022-04-06 02:15:22.650838','2e0c1573-6f3b-4c6b-90e4-5dff011b9673',2),('a4c8a8dd-c48e-4d6b-83fa-1988c96d819d','Add the butter, almonds, and rice to a saucepot and heat over medium. Cook and stir the rice and almonds in the melted butter for 1-2 minutes, or until they begin to smell toasty.','2022-05-16 02:44:19.867401','8c44b28b-2114-44bd-baf2-12fc7a2fe49e',1),('a4cba403-c6d8-441f-87cf-363730b80822','Just before pasta is al dente, scoop out 1½ cups pasta cooking liquid. Add ¾ cup pasta cooking liquid to cream sauce and return to medium heat. Using tongs, transfer spaghetti to pot with sauce (it’s okay if a little water comes along with it). Cook, tossing often and adding Parmesan little by little, until cheese is melted and sauce is creamy, about 3 minutes. If sauce looks tight, add 1–2 Tbsp. pasta cooking liquid. (Cream sauces tighten up very quickly as they cool, so it’s better to lean on the saucier side of things.) Stir in reserved lemon juice; season with more salt, if needed.','2022-04-06 02:12:34.825812','dd51b859-f756-4e11-8be5-f6209bb068e8',4),('a592f6f4-03b5-447c-9dab-0eacedef4c75','Prepare the vegetables before hand so they\'re ready to go when needed. Mince the garlic, grate the ginger, dice the carrot and bell pepper, slice the green onions (separate the green ends from the white ends), and measure the frozen peas.','2022-04-06 02:11:05.487393','e60e7c73-32ac-4170-916e-6a8a0733070c',1),('a6672ab0-7e5f-4250-9588-6489c35b487f','Season with fresh cracked salt and pepper to taste.','2022-05-19 20:38:59.592500','1bef0910-4cea-428d-adcc-3de1e4c24774',7),('aab3031d-4348-4ae1-9a7c-7340457ed4c2','Add broccoli stalks and potato pieces to pot and stir to coat in butter. Pour in 5 cups water, add 1 Tbsp. salt, and bring to a boil over high heat. Reduce heat to medium-low and keep at a simmer. Cover pot and cook until broccoli stalks and potatoes are completely tender (test with a cake tester, paring knife, or fork), 20–25 minutes.','2022-04-06 02:25:08.951157','1ea1dea2-4aa0-4f76-9f5b-eb832e515554',4),('aafc5c95-182d-444d-be3b-daca180df2d5','Whisk together flour, baking powder, and salt in a small bowl.','2022-04-06 02:05:00.860298','1be483a2-eafd-4db8-bc19-f45b9efb8a3c',4),('ac75c77f-95b1-4b20-9d65-ea1258b36a0a','Prepare a grill for high indirect heat (for a charcoal grill, bank coals on one side of grill; for a gas grill, leave one or two burners off); oil grate with vegetable oil. Coarsely chop 2 Tbsp. peppercorns, then coarsely chop basil and mint right on top of peppercorns. Transfer to a small bowl and mix in olive oil; season with salt. Coarsely chop a few more peppercorns and set aside for serving.','2022-04-06 02:16:10.545117','e89aaa1b-efd1-444b-a26d-76f2c8a70e12',1),('addbd44a-55e5-4028-a709-3be5574e30ca','In a large mixing bowl, cream butter and sugars for 3 minutes. They\'ll become light in color and fluffy.','2022-05-19 20:29:33.527938','fea8dffe-d6a9-49d6-b107-3176cd45d5f1',2),('b15daca4-4087-45fe-a1bb-f27fee75d200','For extra luscious chicken, add a tablespoon of butter to the skillet, allow it to melt, then flip the chicken a couple of times to coat in the melted butter.','2022-05-16 02:25:01.288477','0188bb5a-f031-4809-87e7-cf6931c72c37',4),('b252ce7e-903f-48a9-bada-63edc3171e9c','Ladle soup into bowls. Top with garlic chips and more herbs and drizzle over reserved pepper oil.','2022-04-06 02:24:55.016765','893397cd-a91f-4f09-a179-7376cef82601',5),('b28b1451-a0d9-4712-91cf-91c005aedeba','Add the chicken breasts to the skillet and cook for about 8 minutes without flipping (5 minutes for thin-cut breasts). Flip the chicken and then cook on the second side until well browned and cooked through (internal temperature of 165ºF).','2022-05-16 02:25:01.281141','0188bb5a-f031-4809-87e7-cf6931c72c37',3),('b32d7d1b-c429-41b4-89e2-44a266b9aa1b','Salt and pepper chicken. Cover in shallots.','2022-05-19 20:32:17.344559','cf22cdce-1dc5-4e1b-8ebf-a5adbf71cf48',6),('b52d3d03-40a3-4254-a661-0c449e39c744','To assemble each egg salad sandwich: rub the toasts with garlic, place a bit of lettuce on a piece of toast, top with the egg salad mixture, and finish by creating a sandwich with a second piece of toast. Repeat with remaining slices.','2022-03-13 23:39:14.292716','fed3dedf-43b3-4de5-9433-6028e601bcf1',4),('b5771ea1-b3c1-45eb-876a-b8005b5e8eb7','Sprinkle lemon pepper on both sides.','2022-05-19 20:31:56.652003','0ea538fd-b630-45d3-ad65-3000ecf489c9',3),('b57d56c0-eab6-497e-b7ae-a659e3176217','Whisk ½ cup all-purpose flour, 1 tsp. Diamond Crystal or ½ tsp. Morton kosher salt, and 1 tsp. freshly ground black pepper in a medium bowl to combine. Place 2 large eggs in a shallow bowl and beat lightly to blend. Place 2 cups panko or coarse dried breadcrumbs in another shallow bowl.','2022-04-06 02:23:23.773826','85cb832a-a110-46ea-a7db-ccfcfbc883ab',1),('b5d66348-0dfe-40c6-8522-d81ba6236f00','Place bread on a cutting board and spread mayonnaise over top side of each; this is key to a golden, delectable crunch. Heat a small skillet (nonstick, ideally) over medium. Slide in half of butter. When it melts, place 1 slice of bread, mayonnaise side down, in skillet; top with cheese; season with pepper. Top with second slice of bread, mayonnaise side up. When underside is golden brown, about 4 minutes, turn sandwich and add remaining butter to skillet. Press down on sandwich to encourage even browning and to help melt cheese—be gentle, don’t smash it. Cook until second side is golden brown and cheese is melted. Eat immediately, preferably with soup.','2022-04-06 02:12:59.186747','b6807a17-f27c-42aa-a722-930084f8b211',1),('b6994d5b-12cc-483f-8c89-1595420950c8','Bake 25 minutes, or until tender.','2022-05-19 20:28:23.753901','4b1d28f0-c6d5-4a3e-b3a0-2b4b8de73df5',3),('b8cbfd31-90c7-4ac3-9304-6cb494611936','Set saucepan over medium heat and cook curd, whisking constantly and making sure to get into the corners of the pan, until it begins to release steam and thicken, 9–12 minutes. Immediately remove pan from heat, add butter, and whisk until smooth.','2022-04-06 02:18:41.110777','a3e3c39d-34f8-42b7-9727-3711233f1bce',5),('b9cf8d28-8d18-41da-8e60-267730f02384','Peel and finely dice onion and garlic. Peel carrots and sweet potatoes and cut into bite-size pieces. Deseed and dice bell pepper. Remove leaves and core from fennel and chop rest into small pieces. Wash kale, remove leaves from stems, and cut or tear into bite-size pieces.','2022-03-06 00:56:49.899350','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',1),('babb59dc-e4c0-4da1-96ce-a56a177590d1','Bake 20 minutes. Remove from oven. Cover in garlic sauce and allow to rest 10 minutes before serving.','2022-05-19 20:32:17.350314','cf22cdce-1dc5-4e1b-8ebf-a5adbf71cf48',7),('bb3db749-f0ec-4483-af3d-772d0296a999','Meanwhile, if using dried noodles, cook one 8–10 oz. package dried udon or other wheat noodles in a medium pot of boiling salted water according to package directions. Drain and rinse under cold water.','2022-04-06 02:24:44.501606','fde67312-80de-43bd-8c1a-196393822bfc',3),('bcd32bb7-2e6d-4fb0-ad9c-36421c4f7694','Mound salad into shallow bowls or on small plates. Arrange mozzarella fritters on top. Cut remaining 1 lemon into wedges. Serve fritters with store-bought pesto, ciabatta or other crusty bread (if using), and lemon wedges for squeezing over.','2022-04-06 02:23:23.791745','85cb832a-a110-46ea-a7db-ccfcfbc883ab',5),('bd1daa26-3daf-476b-a303-679ee439efe0','Preheat oven to 400 degrees Fahrenheit.','2022-05-19 20:31:56.594498','0ea538fd-b630-45d3-ad65-3000ecf489c9',1),('bf6ed46e-2b6d-426c-b00d-685ba8e9ed49','Blend mango, coconut water, lime juice, salt, 1 tsp. pepper, and 2 cups ice in a blender until smooth. Divide among glasses, then sprinkle with more pepper.','2022-04-06 02:27:10.799693','25c855c1-a417-4c89-8683-1485925a9870',1),('c22a0c07-f0a4-4fb9-95a9-5d6352f34f83','Gradually add flour, cinnamon and salt until just combined. Do not over mix. Optional: Fold in nuts or chocolate chips.','2022-05-19 20:29:33.554771','fea8dffe-d6a9-49d6-b107-3176cd45d5f1',4),('c2aaf104-fc55-4aff-9001-99f70d779401','Meanwhile, add cream to pot with lemon zest and cook over medium heat, whisking often, until liquid is just beginning to simmer, about 2 minutes. Reduce heat to medium-low. Whisk in butter 1 Tbsp. at a time until melted and sauce is creamy and emulsified. Remove from heat.','2022-04-06 02:12:34.817332','dd51b859-f756-4e11-8be5-f6209bb068e8',3),('c428cfc0-b02c-4e26-bc56-5c43d021ab43','Preheat oven to 350 degrees.','2022-05-19 20:28:23.736212','4b1d28f0-c6d5-4a3e-b3a0-2b4b8de73df5',1),('c553bb79-2fcf-4038-a12d-3af536f32ce5','Once simmering, turn the heat down to medium-low. Continue to simmer the rice without a lid, stirring occasionally, for about 40 minutes, or until the rice is very soft and the mixture has thickened considerably. The pudding will thicken further as it cools.','2022-05-16 02:44:19.913915','8c44b28b-2114-44bd-baf2-12fc7a2fe49e',4),('c5e79df6-a254-404a-8249-cce98255c8d3','Bring a large saucepan of salted water to a boil. Add quinoa, return to a boil, and cook, stirring occasionally, until tender, 12–15 minutes. Drain; set aside.','2022-04-06 02:21:54.138572','666a0b5b-90a1-427b-940e-9316d3b67ef8',1),('c6c2eafd-0e10-4100-858f-561d75ae3714','Pulse almond paste in a food processor until broken up into small pieces. Add granulated sugar, cocoa powder, salt, and espresso powder and pulse, scraping down sides of bowl as needed, until mixture is well combined and mostly powdery with a few small clumps. Add egg whites and process until smooth, about 1 minute. Pulse in flour until just combined.','2022-04-06 02:19:07.160006','ba62229e-0ab7-4b07-b4e8-de3b7d876f3b',1),('c99a774d-3ac9-4a3a-96af-dfe0acf615ed','Cut 2\" of the cucumber into ¼\" pieces and set aside for serving; coarsely chop remaining cucumber and place in a large bowl. Cut one-quarter of the bell pepper into ¼\" pieces and set aside for serving; coarsely chop remaining bell pepper and add to bowl with chopped cucumber. Add tomatoes to bowl and toss with shallot, garlic, 2 Tbsp. vinegar, and 1 Tbsp. salt. Let stand 30 minutes at room temperature to let flavors meld.','2022-04-06 02:25:28.554954','f852a4dc-e20b-4a41-acd6-789db0813143',1),('c9e9e390-3b85-45da-a049-1f1b1f1506f0','Carefully remove bowl from steamer (use a hot dish clip or heatproof gloves). Top steamed eggs with soy sauce, scallion, and chili crisp as desired.','2022-04-06 02:13:49.624866','3107980b-9142-415e-9b29-b1ffe0e24119',6),('cb431a14-9759-4047-8c19-b26a140d9ee9','On a floured surface, roll out dough into a rectangle approximately 12 by 18 inches wide. Spread melted butter on top. Paint butter on top with a pastry brush and sprinkle with sugar and orange zest. Using a knife or pizza cutter, cut into 10 even strips. Roll and place in a baking dish or cast iron skillet.','2022-05-19 20:29:51.943567','394c735f-fc64-4257-b506-d5a74283ffdf',5),('ce7fe0c9-714b-4438-bb35-e70eb28a8796','Preheat oven to 350°F. Grease a 1 pound loaf pan.','2022-05-19 20:29:33.518565','fea8dffe-d6a9-49d6-b107-3176cd45d5f1',1),('cef884d8-3707-40ba-a0fe-9ba274a8106b','Heat 2 Tbsp. extra-virgin olive oil in a large Dutch oven or other heavy pot over medium. Cook 2 medium onions, chopped, 4 garlic cloves, finely chopped, and one 2\" piece ginger, scrubbed, finely chopped, stirring occasionally, until onions are softened, 6–8 minutes. Add 2 tsp. ground cumin and ¾ tsp. ground turmeric and stir to coat onions. Season with freshly ground black pepper. Add ½ preserved lemon, rinsed, seeds removed, finely chopped, and 3 Tbsp. double-concentrated tomato paste and cook, stirring often, until tomato paste is darkened in color, about 4 minutes.','2022-04-06 02:24:54.993062','893397cd-a91f-4f09-a179-7376cef82601',1),('cfb11eb6-c076-4019-abdf-950d789d5d76','Bake – 8-10 minutes for the mini shells and 20 minutes for the puff pastry.','2022-05-19 20:28:08.547276','7feccd51-f092-423c-b7af-c269b5d2376d',4),('d022261d-b403-43e5-bdc0-906c94065fe8','Let dough rest for 10 minutes. Preheat oven to 350 degrees F.','2022-05-19 20:29:51.936788','394c735f-fc64-4257-b506-d5a74283ffdf',4),('d049164d-0e01-4c90-b9b0-dec9126b4390','Using smoothie or ice crush setting, purée banana, dates, coffee, cashews, oats, cocoa powder, cardamom, salt, and ½ cup ice in a blender until smooth.','2022-04-06 02:27:19.696025','97a5aba6-9d39-47da-b4a9-9e75d92d7e01',1),('d224330c-f177-4232-b251-80dbfdf2884c','Transfer dough to a medium bowl; fold in any dry spots with a rubber spatula if needed. Cover and chill at least 1 hour.','2022-04-06 02:19:07.165942','ba62229e-0ab7-4b07-b4e8-de3b7d876f3b',2),('d446961b-e843-4b42-8fda-9e1393253e73','Heat a large skillet over medium-low heat, and coat with cooking spray.','2022-04-03 00:48:58.091774','dd24945a-27fb-47d8-994f-7470d8aaf38a',4),('d4e11aed-3de7-4856-9ca6-cccb2acdcf10','Make the Spicy Sesame Dressing:','2022-03-20 23:18:49.363053','6570af5a-e811-45b8-a533-c4f06438e1ff',1),('d5752878-e13f-49c9-a2df-7e6d71d8d6ba','Squeeze juice from 1 lemon half into a measuring glass or medium bowl. Add buttermilk, sour cream, and oil. Finely grate in garlic clove and stir to combine. Season dressing with salt and pepper.','2022-04-06 02:22:09.802667','1d732269-5ba6-4e29-a127-da0a2b6fa54f',2),('d5fd89d3-ce7f-4c42-b411-2825426682bb','Serve immediately or cover and refrigerate for up to 24 hours.','2022-04-06 02:09:23.092528','dcfd256e-b215-4d56-9502-9fd095113a11',3),('d6880a48-031e-4fa3-9ae9-b96f6c654d87','Slowly incorporate powdered sugar. Refrigerate until serving.','2022-05-19 20:27:47.779610','ff6a2ccb-5173-4dbb-ac23-c98e9547488e',2),('d68d8ca3-1fd5-42df-9994-bee0c49b1070','Place a ball of dough on medium high waffle iron and cook until golden – about 3 minutes.','2022-05-19 20:30:29.171246','ffdf0b8f-8079-4fb9-ad6c-01fbf51b98c0',7),('d6b6aa8f-5daa-4f84-a066-d1a860800287','Mix yogurt and brown sugar together in a bowl to make dressing.','2022-04-06 02:09:06.030028','fcd030aa-35d1-4f31-95d6-f2bb0bd7c902',1),('d6fa5bcc-b37d-4e9a-9648-50860ddd6954','Toss with dressing.','2022-05-19 20:32:37.848915','65f1e09c-5981-4745-a266-f75af9a2d902',2),('d8805531-b5f3-4373-bb4d-a0088eee8145','Preheat oven to 350°. Toast pine nuts on a rimmed baking sheet (or quarter sheet pan), tossing once halfway through, until golden brown, 5–7 minutes. Transfer to a food processor and let cool. Add cheese and garlic and pulse until finely ground, about 1 minute. Add basil and place the top back on. With the motor running, add oil in a slow and steady stream until pesto is mostly smooth, with just a few flecks of green, about 1 minute. Season with salt.','2022-04-06 02:15:22.640867','2e0c1573-6f3b-4c6b-90e4-5dff011b9673',1),('d98aaa25-a0c5-41e5-96a5-f2041c2aa858','While the bacon is cooking, finely dice the onion. Add the diced onion to the remaining bacon grease and sauté until tender (about 5 minutes).','2022-05-16 02:48:06.086670','b89a90c2-c036-4ab6-881d-27ab1f5a7b9a',3),('df3fa4a7-b54e-4d25-a442-f2a3ad590d29','Roast 45 minutes, until tender when you insert a fork or toothpick.','2022-05-19 20:38:59.555600','1bef0910-4cea-428d-adcc-3de1e4c24774',3),('e0d48a40-9f5d-45a7-bd86-431b55ba989a','Trim top and bottom from cabbage and slice center portion into 1½\"-thick rounds. Spoon 1–2 Tbsp. dressing onto each plate and top each with a cabbage round. Season cabbage lightly with salt. Drizzle 1–2 Tbsp. dressing over each and work it into the layers with the spoon. Drizzle any remaining dressing over.','2022-04-06 02:21:38.572795','a3b6891b-fad3-4c7a-9240-cbd0cb2fb132',3),('e1285ace-e62b-45ba-8be8-df4858fa4cea','Whisk together white and pale green scallion parts, chile, vinegar, 1 tsp. lime juice, and 1 tsp. honey in a large bowl. Add pear and cucumber; toss to coat. Season with salt; let salad sit 15 minutes.','2022-04-06 02:21:54.146763','666a0b5b-90a1-427b-940e-9316d3b67ef8',2),('e405baf8-d28a-4cde-b9a7-5474e3d3b6c1','Transfer the chicken to a clean cutting board and allow it to rest for five minutes before slicing and serving.','2022-05-16 02:25:01.294314','0188bb5a-f031-4809-87e7-cf6931c72c37',5),('e64627e4-4e2d-4f8d-a73a-91b6daa334ac','Make the vinaigrette first. Whisk together the olive oil, lemon juice, red wine vinegar, Dijon, minced garlic, salt, and pepper.','2022-05-16 02:45:37.369967','cebd3d9c-966e-4674-bbc8-72db0b3f0429',1),('e83a9dc9-8f6d-4eab-b44e-68cd45f0039a','Whisk mayonnaise, creme fraiche, lemon juice, tarragon, sugar, salt, black pepper, and cayenne together in a bowl.','2022-04-06 02:09:23.079040','dcfd256e-b215-4d56-9502-9fd095113a11',1),('e8e4a4f6-298e-4183-a103-294b27354c10','In a jar, combine olive oil, vinegar, salt and pepper. Shake well.','2022-05-19 20:32:52.051237','940ecc52-6188-4754-b2c6-3a9d5a8aedcf',2),('ec625c30-9797-4190-afd1-ccfa8e15b57c','Mix together mayonnaise, lemon juice, and pepper in a medium bowl. Toss with chicken, toasted almonds, and celery.','2022-04-06 02:07:43.782627','fd273271-21a1-43b1-b0bb-4e8c22c19b21',2),('ecdbbc8a-ecbb-475e-a4e9-9759560f0cc6','Add the eggs and vegetables back to the skillet with the rice and stir to combine. Allow the residual heat to heat everything through. Top with the remaining green ends of the sliced green onions. Taste and adjust the soy sauce or sesame oil to your liking.','2022-04-06 02:11:05.511423','e60e7c73-32ac-4170-916e-6a8a0733070c',6),('ee8714ea-a177-4794-903f-6985781bdd4f','Cook pasta in another large pot of boiling heavily salted water, stirring occasionally, until very al dente (pasta will finish cooking in the sauce).','2022-04-06 02:12:34.810482','dd51b859-f756-4e11-8be5-f6209bb068e8',2),('eeb884da-a970-4e9b-af11-2d26ee80fa52','Toss arugula with beets, figs, jicama sticks, walnuts, and balsamic vinaigrette. Top with goat cheese.','2022-05-19 20:38:59.582887','1bef0910-4cea-428d-adcc-3de1e4c24774',6),('ef72eab5-6f1d-45fa-a26e-6da23c9b4629','Serve sprinkled with some extra sesame seeds. Leftover coleslaw will keep covered in the refrigerator for a few days. Simply re-toss and enjoy.','2022-03-20 23:18:49.370436','6570af5a-e811-45b8-a533-c4f06438e1ff',5),('efcaed4c-e588-41fa-9d0b-ba09bff2fd5a','Add the cooking oil to a large skillet and heat over medium-low (or medium for thin-cut breasts). Once hot, swirl the oil to coat the skillet.','2022-05-16 02:25:01.275410','0188bb5a-f031-4809-87e7-cf6931c72c37',2),('efcd7c9a-ce74-4d99-85fc-a9871a042c36','Transfer 1 cup pasta cooking liquid to a large skillet. Bring to a gentle simmer, then whisk in butter, no more than 1 tablespoon at a time, until melted. Whisking constantly, gradually add cheese, making sure it’s completely melted and incorporated before adding more. Add pasta and toss to coat, adding more pasta cooking liquid as needed, until sauce blankets noodles completely. Serve topped with pepper and more cheese.','2022-04-06 02:13:12.228920','4ddb632f-e9f1-4eed-a3bc-dc0984887e63',2),('f05b6758-a277-41d3-81cf-629daec303c0','Bake cookies, rotating baking sheets top to bottom and front to back halfway through, just until puffed and cracked and edges are set (cookies will look slightly underbaked between the cracks), 12–14 minutes. Let cool on baking sheets.','2022-04-06 02:19:07.191922','ba62229e-0ab7-4b07-b4e8-de3b7d876f3b',4),('f0de9bf8-4e15-4613-b2e1-31314baf823d','Heat remaining 4 Tbsp. extra-virgin olive oil in a medium skillet over medium. Working in 2 batches, carefully place mozzarella slices in pan and cook, turning halfway through, until golden brown, 5–7 minutes total. Using tongs, carefully transfer mozzarella fritters to paper towels to drain.','2022-04-06 02:23:23.787886','85cb832a-a110-46ea-a7db-ccfcfbc883ab',4),('f3eb6f33-2c34-43f9-a088-8d973456357e','Divide pasta among bowls. Top with finely grated Parmesan.','2022-04-06 02:15:22.677688','2e0c1573-6f3b-4c6b-90e4-5dff011b9673',5),('f45a7ecf-a098-404d-a029-e3bc3472a2fd','Pour liquid mixture into well and stir until combined into dough.','2022-05-19 20:30:29.150820','ffdf0b8f-8079-4fb9-ad6c-01fbf51b98c0',4),('f479ab51-b762-4a5d-8efd-418cc0845412','Stir in water, vegetable stock, and tomatoes and bring to a boil. Reduce heat and let simmer for approx. 15 – 20 min. until sweet potatoes are softened, but still firm.','2022-03-06 00:56:49.903094','ce7c42d8-f557-42e1-8e53-d9925bcafd3b',3),('f685d2ce-ea12-45bf-86f3-fe8155aab0ed','Preheat oven to 375°. Toss bread with olive oil on a baking sheet; season with salt and pepper. Bake, tossing occasionally, until golden, 10–15 minutes.','2022-04-06 02:11:29.438499','f5762675-fe7e-4f23-83da-e8f379b8fef7',3),('f7299365-7bd1-4394-aec3-ad9d7ec737d6','Place 10 oz. spring greens salad mix or other mixed greens in a large bowl and evenly drizzle 2 Tbsp. extra-virgin olive oil over. Cut 1 lemon in half and squeeze juice over greens. Toss to coat, then season salad with salt and pepper.','2022-04-06 02:23:23.779331','85cb832a-a110-46ea-a7db-ccfcfbc883ab',2),('f8aff9a3-76f0-482d-9e06-e177c8b780c7','Preheat oven according to package directions. (350F for mini phyllo cups and 400-425F for puff pastry is standard.)','2022-05-19 20:28:08.515579','7feccd51-f092-423c-b7af-c269b5d2376d',1),('f97b73f3-aa0b-4a9c-8fa9-3b027b7de4d6','Combine olive oil and balsamic vinegar in a jar or whisk in a bowl until well combined.','2022-05-19 20:38:59.567943','1bef0910-4cea-428d-adcc-3de1e4c24774',4),('f9f88ce3-5d24-430b-aa86-987a337717b7','Do Ahead: Gazpacho can be made 1 day ahead; cover and chill.','2022-04-06 02:25:28.569717','f852a4dc-e20b-4a41-acd6-789db0813143',4),('fc2f6ff2-49c6-4dcc-a987-4d720989793b','Preheat the oven\'s broiler and place an oven rack a few inches below it. Line a baking sheet with parchment paper and lightly grease the parchment.','2022-04-06 02:05:00.841928','1be483a2-eafd-4db8-bc19-f45b9efb8a3c',1),('fc62bb39-078b-4741-a464-c4a960bb37ca','Bake 20 minutes (30 for larger breasts).','2022-05-19 20:31:56.665794','0ea538fd-b630-45d3-ad65-3000ecf489c9',4),('fd32dba5-a103-4a27-bdf3-74fcef1a3450','Turn oven off. Cover rolls with a damp towel and allow to rise in the warmed oven for 25 minutes. Remove from oven, preheat again to 350 degrees F. Cover rolls in ¼ cup heavy cream. Bake 15 minutes, or until slightly golden.','2022-05-19 20:29:51.949426','394c735f-fc64-4257-b506-d5a74283ffdf',6),('fdd709e0-a301-4700-bb79-7ad58f381d5c','Add eggs and hon-dashi to bowl of mushroom soaking liquid and whisk to combine. Strain through a fine-mesh sieve into a heatproof serving bowl (you will steam and serve from this bowl) to remove bubbles. Using a spoon, skim off any remaining bubbles, then gently sprinkle mushrooms over egg mixture.','2022-04-06 02:13:49.602620','3107980b-9142-415e-9b29-b1ffe0e24119',3),('fdef7100-070f-4eaa-9a95-785db7a178c6','Heat ¼ cup vegetable oil in a large heavy-bottomed pot over medium-high. Pat dry a heaping ½ cup rinsed chickpeas (from two 15.5-oz. cans) and add to pot (stand back to avoid pops and splatters). Cook, stirring often, until chickpeas are golden brown with crisp outer shells, about 3 minutes. Remove pot from heat. Using a slotted spoon, transfer chickpeas to a plate, leaving oil behind. Season chickpeas with kosher salt and nutritional yeast; set aside.','2022-04-06 02:24:44.486156','fde67312-80de-43bd-8c1a-196393822bfc',1),('feb340b2-f43a-4e1c-a719-3c3fd0f1dd96','Place pesto and 2 Tbsp. unsalted butter, cut into pieces, in a large bowl. Add pasta and ¼ cup pasta cooking liquid. Using tongs, toss vigorously, adding more pasta cooking liquid if needed, until pasta is glossy and well coated with sauce. Season with salt.','2022-04-06 02:15:22.667489','2e0c1573-6f3b-4c6b-90e4-5dff011b9673',4);
