INSERT INTO `recipes` VALUES ('0188bb5a-f031-4809-87e7-cf6931c72c37','Pan Seared Chicken Breasts',NULL,'Pan_Seared_Chicken_Breasts.jpg','15 mins','5 mins','20 mins','https://www.budgetbytes.com/how-to-cook-chicken-breast-in-a-pan/',1,'2022-05-16 02:25:00.032176','Learn how to cook tender, juicy, and flavorful boneless chicken breast in a pan. Perfect for quick dinners and meal prep!'),('054258b8-53d3-4453-8ebd-34e4f933fe93','Salsa de Molcajete',NULL,'Salsa_de_Molcajete.jpg','','','','https://www.bonappetit.com/recipe/salsa-de-molcajete',1,'2022-04-06 02:15:01.360868','Tangy, smokey, and just a touch spicy, this simple salsa from Bricia Lopez made with charred tomatoes shows how just a few ingredients can transform into something truly spectacular.'),('0ea538fd-b630-45d3-ad65-3000ecf489c9','Lemon Pepper Chicken',NULL,'Lemon_Pepper_Chicken_1652992315192.jpg','20 mins','5 mins','25 mins','https://julieblanner.com/lemon-pepper-chicken/',1,'2022-05-19 20:31:55.212659','You\'ll love this TRIED & TRUE lemon pepper chicken for an easy family meal! So easy to prep, this baked crusted chicken is juicy and loaded with flavor.'),('15b901f9-3232-4f6e-9664-a243c932fe32','Karak Chai',NULL,'Karak_Chai.jpg','','','','https://www.bonappetit.com/recipe/karak-chai',1,'2022-04-06 02:14:47.625884','Recipe developer Zaynab Issa\'s Karak Chai recipe is richer than most cups of tea, thanks to its generous use of evaporated milk and hints of vanilla, cinnamon, and cardamom.'),('1b3285cb-212e-4bf2-bc4a-1f70786ac759','Pecan Rolls',NULL,'Pecan_Rolls_1652992279440.jpg','20 mins','10 mins','30 mins','https://julieblanner.com/pecan-rolls/',1,'2022-05-19 20:31:19.450994','1 dish Pecan Rolls with a gooey, sticky caramel sauce and cinnamon made in 10 minutes! You\'ll love this easy Pecan Rolls recipe with a shortcut!'),('1be483a2-eafd-4db8-bc19-f45b9efb8a3c','Toasted Marshmallow Cake',NULL,'Toasted_Marshmallow_Cake.jpg','40 mins ','20 mins ','1 hr ','https://www.allrecipes.com/recipe/8373688/toasted-marshmallow-cake/',1,'2022-04-06 02:04:59.743084','This delicious white cake features toasted marshmallows in the batter for a truly spectacular dessert.'),('1bef0910-4cea-428d-adcc-3de1e4c24774','Roasted Beet Salad with Balsamic Vinaigrette',NULL,'Roasted_Beet_Salad_with_Balsamic_Vinaigrette_1652992738258.jpg','50 mins','10 mins','1 hr','https://julieblanner.com/beet-salad/',1,'2022-05-19 20:38:58.274843','This roasted beet salad is gorgeous and more delicious with each bite! Loaded with tender beets + root veggies, it\'s a salad to crave!'),('1d732269-5ba6-4e29-a127-da0a2b6fa54f','Mortadella Wedge Salad',NULL,'Mortadella_Wedge_Salad.jpg','','','','https://www.bonappetit.com/recipe/mortadella-wedge-salad',1,'2022-04-06 02:22:08.191419','This salad isn\'t like a regular wedge, it\'s a cool wedge—and by \"cool\" we mean stuffed with pickled jalapeños and paper-thin slices of mortadella and drizzled with a tangy buttermilk dressing.'),('1ea1dea2-4aa0-4f76-9f5b-eb832e515554','Broccoli Cheddar Soup With Cheesy Croutons',NULL,'Broccoli_Cheddar_Soup_With_Cheesy_Croutons.jpg','','','','https://www.bonappetit.com/recipe/broccoli-cheddar-soup',1,'2022-04-06 02:25:07.692933','Our easy broccoli cheddar soup recipe is lighter than some versions, thickened with puréed vegetables instead of cream—and finished with cheesy croutons.'),('25c855c1-a417-4c89-8683-1485925a9870','Beauty-Food Mango Slushy',NULL,'Beauty-Food_Mango_Slushy.jpg','','','','https://www.bonappetit.com/recipe/beauty-food-mango-slushy',1,'2022-04-06 02:27:09.733981','Mangoes are packed with vitamins C and A, both of which provide major skin-brightening benefits. Lime and chile keep this slushy spicy and bright. This recipe is part of the Healthyish slushy trifecta.'),('2e0c1573-6f3b-4c6b-90e4-5dff011b9673','BA\'s Best Pesto',NULL,'BA\'s_Best_Pesto.jpg','','','','https://www.bonappetit.com/recipe/best-pesto',1,'2022-04-06 02:15:21.338982','The key for this classic pesto recipe is to add the basil at the very end so it doesn’t get bruised or lose its flavor and maintains its vibrant green color.'),('30386c99-cc37-49c8-8110-7eabf566410c','Cacao and Coconut Latte',NULL,'Cacao_and_Coconut_Latte.jpg','','','','https://www.bonappetit.com/recipe/cacao-coconut-latte',1,'2022-04-06 02:17:00.291422','For a more caramel-y depth of flavor (or if you just really love coconut), toast the coconut flakes first and substitute coconut sugar for the organic sugar.'),('3107980b-9142-415e-9b29-b1ffe0e24119','Silky Steamed Eggs with Mushrooms',NULL,'Silky_Steamed_Eggs_with_Mushrooms.jpg','','','','https://www.bonappetit.com/recipe/mushroom-steamed-eggs',1,'2022-04-06 02:13:48.568143','These savory and oh-so-simple steamed eggs are the definition of cozy comfort food.'),('35a89094-78da-4931-96cc-d5cbf0f5d6fb','Teriyaki Ground Beef Skillet',NULL,'Teriyaki_Ground_Beef_Skillet.jpg','10 mins ','15 mins ','25 mins ','https://www.allrecipes.com/recipe/284172/teriyaki-ground-beef-skillet/',1,'2022-04-06 02:04:36.166213','A quick and easy one-pan, kid friendly teriyaki ground beef skillet dinner with sweet, rich, and flavorful meat and Asian flavors. Served with white rice.'),('394c735f-fc64-4257-b506-d5a74283ffdf','1 Hour Easy Orange Rolls Recipe',NULL,'1_Hour_Easy_Orange_Rolls_Recipe_1652992190777.jpg','15 mins','10 mins','1 hr','https://julieblanner.com/1-hour-easy-orange-rolls-recipe/',1,'2022-05-19 20:29:50.804974','Orange rolls (in less than an hour) These light and fluffy orange rolls are a breakfast and brunch dream, perfect for Christmas morning!'),('3cd3f061-f3bc-4042-84c6-bb5f13722996','Tartar Sauce',NULL,'Tartar_Sauce.jpg','','','','https://tastesbetterfromscratch.com/tartar-sauce/',1,'2022-03-06 02:44:17.897809','This homemade Tartar Sauce recipe is creamy and fresh! It only takes 5 minutes to make, and tastes so much better than store-bought!'),('3e8dddec-93d9-463f-b084-f13b1086dea8','Grape-Tarragon Spritzer',NULL,'Grape-Tarragon_Spritzer.jpg','','','','https://www.bonappetit.com/recipe/grape-tarragon-spritzer',1,'2022-04-06 02:14:06.674194','Looking for the ultimate booze-free cooler? Try Bryant Terry’s refreshing grape-tarragon spritzer, which cleverly keeps its cool with frozen grapes instead of ice cubes.'),('4b1d28f0-c6d5-4a3e-b3a0-2b4b8de73df5','Baked Apple Slices',NULL,'Baked_Apple_Slices_1652992102278.jpg','25 mins','5 mins','30 mins','https://julieblanner.com/baked-apple-slices/',1,'2022-05-19 20:28:22.292947','Baked Apple Slices are the BEST easy dessert, side dish, or breakfast. This TRIED + TRUE Baked Apple Slices recipe will thrill the family.'),('4ddb632f-e9f1-4eed-a3bc-dc0984887e63','Fettuccine Alfredo',NULL,'Fettuccine_Alfredo.jpg','','','','https://www.bonappetit.com/recipe/fettuccine-alfredo',1,'2022-04-06 02:13:11.243474','A fettuccine Alfredo recipe should never include cream; the silky sauce comes from an emulsion of grated Parmesan, melted butter, and starchy pasta water.'),('5bab4042-9684-4fae-ad3b-5f5de9350580','Mango and Avocado Salad',NULL,'Mango_and_Avocado_Salad.jpg','','','','https://www.bonappetit.com/recipe/mango-and-avocado-salad',1,'2022-04-06 02:22:33.097295','With creamy avocado and sweet ripe mango, this cooling salad will complement a meal that’s big on heat and spice.'),('6570af5a-e811-45b8-a533-c4f06438e1ff','Spicy Sesame Coleslaw',NULL,'Spicy_Sesame_Coleslaw.jpg','','20 mins','20 mins','https://www.101cookbooks.com/spicy-sesame-coleslaw/',1,'2022-03-20 23:18:47.975286','A spicy sesame coleslaw with feathery green and red cabbages along with carrots, apples, and scallions tossed with a spicy, creamy sesame dressing.'),('65f1e09c-5981-4745-a266-f75af9a2d902','Apple Salad',NULL,'Apple_Salad_1652992356866.jpg','','5 mins','5 mins','https://julieblanner.com/apple-salad-recipe/',1,'2022-05-19 20:32:36.882311','This is a fresh, crunchy Apple Salad full of flavor! It\'s a sweet and savory Apple Salad Recipe with butter lettuce + wholesome ingredients.'),('666a0b5b-90a1-427b-940e-9316d3b67ef8','Asian Pear–Shiso Salad With Quinoa',NULL,'Asian_Pear–Shiso_Salad_With_Quinoa.jpg','','','','https://www.bonappetit.com/recipe/asian-pear-shiso-salad-with-quinoa',1,'2022-04-06 02:21:52.592405','This layered salad is a garden of textural delight with crisp Asian pear, creamy Greek yogurt, and a shower of quinoa.'),('6c629135-2f44-49dd-bb25-0141b773a34e','Espresso Hot Chocolate',NULL,'Espresso_Hot_Chocolate.jpg','','','','https://www.bonappetit.com/recipe/espresso-hot-chocolate',1,'2022-04-06 02:17:32.377365','If you want to mellow this out a bit, use strong coffee or a couple teaspoons of espresso powder instead of the freshly made espresso.'),('7feccd51-f092-423c-b7af-c269b5d2376d','Baked Brie Bites',NULL,'Baked_Brie_Bites_1652992087403.jpg','8 mins','10 mins','18 mins','https://julieblanner.com/strawberry-brie-bites-easy-appetizer-recipe/',1,'2022-05-19 20:28:07.417950','These Baked Brie Bites are a super simple appetizer that\'s made with just 4 ingredients and they are ready to serve in less than 20 minutes.'),('81ecff09-f4d5-46c7-86d6-15489f1069aa','California Chicken',NULL,'California_Chicken_1652992454863.jpg','12 mins','10 mins','22 mins','https://julieblanner.com/california-chicken/',1,'2022-05-19 20:34:14.874789','California Chicken is a quick and delicious grilled or baked chicken that is incredibly moist and covered in cheese, avocado, and tomatoes!'),('82e3139c-d8a3-4b0b-9af6-3fde45528c2e','Fluffy Homemade Pancakes',NULL,'Fluffy_Homemade_Pancakes.jpg','20 mins','10 mins','45 mins','https://www.budgetbytes.com/homemade-pancakes/',1,'2022-05-16 02:23:49.233469','This easy homemade pancake recipe makes the most delicious and fluffy stack of pancakes around! Perfect for a cozy weekend breakfast!'),('85cb832a-a110-46ea-a7db-ccfcfbc883ab','Mozzarella Fritters With Pesto and Greens',NULL,'Mozzarella_Fritters_With_Pesto_and_Greens.jpg','','','','https://www.bonappetit.com/recipe/mozzarella-fritters',1,'2022-04-06 02:23:22.687424','These crispy-creamy fritters come together even faster than you\'ll devour them.'),('87a32415-38d7-47b0-ac8e-13c8d2860fa4','Fried Lemon and Radish Salad',NULL,'Fried_Lemon_and_Radish_Salad.jpg','','','','https://www.bonappetit.com/recipe/fried-lemon-and-radish-salad',1,'2022-04-06 02:21:23.994616','You can—and you should!—eat fried slices of lemon in your salad. (Trust us.)'),('87c7f114-0945-4706-b90f-76de7818c35b','Blueberry Smoothie',NULL,'Blueberry_Smoothie.jpg','','5 mins ','5 mins ','https://www.allrecipes.com/recipe/215184/blueberry-smoothie/',1,'2022-04-06 02:06:11.529059','This blueberry smoothie with plain yogurt is seasoned with a bit of nutmeg.'),('893397cd-a91f-4f09-a179-7376cef82601','Red Lentil Soup With Preserved Lemon and Crispy Garlic',NULL,'Red_Lentil_Soup_With_Preserved_Lemon_and_Crispy_Garlic.jpg','','','','https://www.bonappetit.com/recipe/red-lentil-soup-with-preserved-lemon',1,'2022-04-06 02:24:53.948577','With the help of punchy preserved lemon and crispy garlic chips, that bag of lentils in the back of your pantry is in for a major—and shockingly simple—glow-up.'),('8c44b28b-2114-44bd-baf2-12fc7a2fe49e','Creamy Rice Pudding',NULL,'Creamy_Rice_Pudding.jpg','45 mins','5 mins','50 mins','https://www.budgetbytes.com/rice-pudding/',1,'2022-05-16 02:44:18.565224','Creamy rice pudding is a simple, delicious, and inexpensive dessert full of warm flavors like vanilla, cinnamon, and nutmeg.'),('939bd8bb-0de2-4eda-b060-db31bca15902','Spring Salad Mix',NULL,'Spring_Salad_Mix_1652992385579.jpg','','10 mins','10 mins','https://julieblanner.com/summer-salad/',1,'2022-05-19 20:33:05.597797','This spring salad mix is the perfect summer salad to take with you to picnics or enjoy for lunch. Full of fruity flavor served with a champagne vinaigrette.'),('940ecc52-6188-4754-b2c6-3a9d5a8aedcf','Italian Salad with Italian Salad Dressing',NULL,'Italian_Salad_with_Italian_Salad_Dressing_1652992370771.jpg','','5 mins','5 mins','https://julieblanner.com/italian-salad/',1,'2022-05-19 20:32:50.807423','A simple Italian Salad with the best Italiand Dressing made in just 5 minutes. Get the secrets that make this Italian salad recipe stand above the rest!'),('97a5aba6-9d39-47da-b4a9-9e75d92d7e01','Banana, Coffee, Cashew, and Cocoa Smoothie',NULL,'Banana,_Coffee,_Cashew,_and_Cocoa_Smoothie.jpg','','','','https://www.bonappetit.com/recipe/banana-coffee-cashew-cocoa-smoothie',1,'2022-04-06 02:27:18.662638','This power-breakfast smoothie will be extra smooth if you soak the nuts and oats in water overnight; drain before proceeding.'),('9bfae3cc-3cda-4945-b352-cfa9b2aea8a6','Cabbage Salad Recipe',NULL,'Cabbage_Salad_Recipe_1652992717077.jpg','0 mins','10 mins','5 mins','https://julieblanner.com/cabbage-salad/',1,'2022-05-19 20:38:37.112082','This delicious, refreshing Cabbage Salad recipe is the perfect choice for potlucks, barbecues and more. Learn the secrets to this light and tangy side dish!'),('a3b6891b-fad3-4c7a-9240-cbd0cb2fb132','Napa Cabbage Wedge With Sesame Ranch',NULL,'Napa_Cabbage_Wedge_With_Sesame_Ranch.jpg','','','','https://www.bonappetit.com/recipe/napa-cabbage-wedge-with-sesame-ranch',1,'2022-04-06 02:21:37.525816','Iceberg’s reign over the wedge salad stops here.'),('a3e3c39d-34f8-42b7-9727-3711233f1bce','Passion Fruit Bars',NULL,'Passion_Fruit_Bars.jpg','','','','https://www.bonappetit.com/recipe/passion-fruit-bars',1,'2022-04-06 02:18:39.917622','Lemon bars on holiday in the tropics.'),('b3ed7cb1-9534-4983-8af0-808930ec4382','Easy Hors d’oeuvres',NULL,'Easy_Hors_d’oeuvres_1652992679707.jpg','1 hr','1 hr','2 hrs','https://julieblanner.com/hors-doeuvres/',1,'2022-05-19 20:37:59.738159','These 20 hors d\'oeuvres recipes are so good, you\'ll want to make a meal out of them! They\'re quick, easy, beautiful and so delicious!'),('b4191208-a0a1-4ea3-a1ce-e6cdeca0af94','French Toast',NULL,'French_Toast.jpg','10 mins ','5 mins ','15 mins ','https://www.allrecipes.com/recipe/7016/french-toast-i/',1,'2022-03-20 22:14:31.963070','This delicious French toast recipe can be ready in about 15 minutes with eggs, milk, a few spices, and your favorite bread.'),('b6807a17-f27c-42aa-a722-930084f8b211','Best-Ever Grilled Cheese',NULL,'Best-Ever_Grilled_Cheese.jpg','','','','https://www.bonappetit.com/recipe/best-ever-grilled-cheese',1,'2022-04-06 02:12:57.919581','Looking to majorly upgrade the classic grilled cheese? This recipe has you covered with bread slicked with and crisped up by the power of mayonnaise.'),('b89a90c2-c036-4ab6-881d-27ab1f5a7b9a','Pasta with Bacon and Peas',NULL,'Pasta_with_Bacon_and_Peas.jpg','20 mins','5 mins','25 mins','https://www.budgetbytes.com/pasta-with-bacon-and-peas/',1,'2022-05-16 02:48:02.486817','Pasta with Bacon and Peas is a quick, satisfying, and inexpensive meal that you can make with ingredients that you can keep on hand.'),('ba62229e-0ab7-4b07-b4e8-de3b7d876f3b','Cocoa-Coffee Almond Cookies',NULL,'Cocoa-Coffee_Almond_Cookies.jpg','','','','https://www.bonappetit.com/recipe/cocoa-coffee-almond-cookies',1,'2022-04-06 02:19:06.134268','Almond paste makes these supremely fudgy cookies extra chewy, while coffee adds a savory note that complements the chocolate and nut flavors.'),('ce7c42d8-f557-42e1-8e53-d9925bcafd3b','Moroccan-inspired chickpea stew',NULL,'Moroccan-inspired_chickpea_stew.jpg','','45 min.','','https://www.kitchenstories.com/en/recipes/moroccan-inspired-chickpea-stew',1,'2022-03-06 00:56:48.735727','Peel and finely dice onion and garlic. Peel carrots and sweet potatoes and cut into bite-size pieces. Deseed and dice bell pepper. Remove leaves and core from fennel and chop rest into small pieces. Wash kale, remove leaves from stems, and cut or tear into bite-size pieces.'),('cebd3d9c-966e-4674-bbc8-72db0b3f0429','Lemony White Bean Salad',NULL,'Lemony_White_Bean_Salad.jpg','','15 mins','15 mins','https://www.budgetbytes.com/lemony-white-bean-salad/',1,'2022-05-16 02:45:36.045932','This simple Lemony White Bean Salad is an inexpensive, light, and fresh option for summer meals or your weekly meal prep.'),('cf22c