ot-fried-rice/',1,'2022-04-06 02:11:01.219681','Vegetable Fried Rice is a fast, easy, delicious, and budget-friendly meal that you can whip up with ingredients on hand at any time!'),('e89aaa1b-efd1-444b-a26d-76f2c8a70e12','Porterhouse With Summer Au Poivre Sauce',NULL,'Porterhouse_With_Summer_Au_Poivre_Sauce.jpg','','','','https://www.bonappetit.com/recipe/porterhouse-with-summer-au-poivre-sauce',1,'2022-04-06 02:16:09.360427','Getting a porterhouse steak to a blushing, consistent medium-rare is a feat—but the key is to keep it moving.'),('f211abb9-326f-4fce-ba5d-893fe97909fe','Fattoush',NULL,'Fattoush.jpg','','','','https://www.bonappetit.com/recipe/fattoush',1,'2022-04-06 02:23:00.120295','Lebanon\'s most famous salad, fattoush, is a juicy, crunchy mix of herbs, cucumber, tomatoes, and pita, bright with the flavor of sumac.'),('f3248d19-b91e-46da-b3ab-8735aac7c391','Roasted Sweet Potatoes',NULL,'Roasted_Sweet_Potatoes.jpg','','','','https://www.bonappetit.com/recipe/roasted-sweet-potatoes',1,'2022-04-06 02:15:43.567097','Looking for a roasted sweet potatoes recipe that comes out great every time? Here’s the best (and easiest) way to make sweet potatoes in 45 minutes!'),('f5762675-fe7e-4f23-83da-e8f379b8fef7','Classic Caesar Salad',NULL,'Classic_Caesar_Salad.jpg','','','','https://www.bonappetit.com/recipe/classic-caesar-salad',1,'2022-04-06 02:11:28.230638','A great Caesar salad recipe like this one gets its swagger from cold and crisp greens, a creamy and briny dressing, and freshly made croutons.'),('f852a4dc-e20b-4a41-acd6-789db0813143','Summer Gazpacho',NULL,'Summer_Gazpacho.jpg','','','','https://www.bonappetit.com/recipe/summer-gazpacho',1,'2022-04-06 02:25:27.608816','A great, nay, the best gazpacho recipe starts with epic tomatoes—because this preparation is raw, there’s no hiding a sub-standard specimen. Go for gold! Er—red?'),('fcd030aa-35d1-4f31-95d6-f2bb0bd7c902','Autumn Waldorf Salad',NULL,'Autumn_Waldorf_Salad.jpg','','20 mins ','50 mins ','https://www.allrecipes.com/recipe/255841/autumn-waldorf-salad/',1,'2022-04-06 02:09:04.169761','This fall spin on a Waldorf salad made with apple, pear, celery, cranberries, and yogurt is a light side dish with festive autumnal flavor.'),('fd273271-21a1-43b1-b0bb-4e8c22c19b21','Basic Chicken Salad',NULL,'Basic_Chicken_Salad.jpg','5 mins ','5 mins ','10 mins ','https://www.allrecipes.com/recipe/8499/basic-chicken-salad/',1,'2022-04-06 02:07:42.818089','This creamy chicken salad recipes uses basic ingredients, along with crunchy almonds and celery, to produce a delicious lunch that\'s ready in just 10 minutes.'),('fde67312-80de-43bd-8c1a-196393822bfc','Chickpea Noodle Soup',NULL,'Chickpea_Noodle_Soup.jpg','','','','https://www.bonappetit.com/recipe/chickpea-noodle-soup',1,'2022-04-06 02:24:43.427671','There\'s triple the chickpea in this quick and comforting soup: The broth is flavored with chickpea miso, and the mix of soft and crispy chickpeas makes for a delightful mix of textures.'),('fea8dffe-d6a9-49d6-b107-3176cd45d5f1','Banana Bread without Baking Soda or Baking Powder',NULL,'Banana_Bread_without_Baking_Soda_or_Baking_Powder_1652992172048.jpg','','10 mins','55 mins','https://julieblanner.com/banana-bread-without-baking-soda/',1,'2022-05-19 20:29:32.115182','Incredibly moist, buttery banana bread without baking soda or powder! Get the secrets that make it stand above the rest!'),('fed3dedf-43b3-4de5-9433-6028e601bcf1','The Perfect Egg Salad Sandwich',NULL,'The_Perfect_Egg_Salad_Sandwich.jpg','','10 mins','18 mins','https://www.101cookbooks.com/egg-salad/',1,'2022-03-13 23:39:12.974131','The perfect egg salad sandwich is all about the little tweaks and a smart ratio of eggs to other ingredients. This is my favorite. Served on garlic-rubbed toasted bread with chopped celery, onion, and whole-grain mustard.'),('ff6a2ccb-5173-4dbb-ac23-c98e9547488e','Mascarpone Cream',NULL,'Mascarpone_Cream_1652992066333.jpg','0 mins','5 mins','5 mins','https://julieblanner.com/mascarpone-cream/',1,'2022-05-19 20:27:46.392558','This mascarpone cream recipe is perfect with any dessert. Rich and flavorful homemade whipped cream takes less than 5 minutes to make.'),('ffdf0b8f-8079-4fb9-ad6c-01fbf51b98c0','Authentic Belgian Waffle Recipe',NULL,'Authentic_Belgian_Waffle_Recipe_1652992227895.jpg','3 mins','15 mins','1 hr 3 mins','https://julieblanner.com/best-belgian-waffle-recipe/',1,'2022-05-19 20:30:27.906859','An Authentic Belgian Waffle Recipe made with a TRIED & TRUE secret ingredient. Add a little creme fraiche and fresh fruit and enjoy for breakfast or brunch!');
